INSERT INTO `author` VALUES (1,'Herode','phd','Test description','lecturer','0789432567','yerode@gmail.com','NA','/tmp/php0eLCWZ','1','2020-07-21 18:53:56','2020-04-06 13:45:24','2020-07-21 18:53:56'),(2,'Alexander D. Poularikas','PhD','Dr. Poularikas has been involved for many years in research related to space applications. He was a Faculty Fellow at NASA for two consecutive times, doing research on wave propagation in random media, radiowave scintillations due to ionosphere, and the effect of ionosphere on the accuracy of satellite orbit defamation. Dr. Poularikas has also been involved in image science, image detection through random media; specifically, he was involved in aero-optics research of hypervelocity vehicles. At present he is involved in random digital signal processing, spectral estimation and adaptive filtering for signal processing and system identification.','Professor','2568246316','poulara@uah.edu','Alabama, USA','/tmp/phpwQPQBq','1',NULL,'2020-07-21 19:02:40','2020-07-21 19:02:40'),(3,'Ron Schmitt','PhD','Ron Schmitt is the director of electrical engineering support for Sensor Research and Development Corp. in Orono, Maine. He manages the group responsible for electronics design for chemical-sensor research and products. He has a BSEE from Cornell University and an MSEE from the University of Pennsylvania. He is currently a PhD candidate at the University of Maine.','Doctor','0655963224','info@kambarage.com','Maine, United States of America','/tmp/phpgWYDkS','1',NULL,'2020-07-23 08:00:49','2020-07-23 08:00:49'),(4,'Charles M. Bergren','Unknown','Not much is gathered.','Unknown','111111','info@kambarage.com','Unknown','/tmp/phpfbp5cM','1',NULL,'2020-07-23 08:10:34','2020-07-23 08:10:34'),(5,'Robert W. Erickson','PhD','Robert W. Erickson received the B.S. (1978), M.S. (1980), and Ph.D. (1982) degrees in Electrical Engineering, from the California Institute of Technology, Pasadena, California. In 1996, he received the IEEE Power Electronics Society Transactions Prize Paper Award, for the paper \"Nonlinear Carrier Control for High-Power-Factor Boost Rectifier.\" He received the CU-Boulder Inventor of the Year Award in 2015, and the Holland Teaching Excellence Award in 2010. Professor Erickson is a Fellow of the IEEE, a Fellow of the CU/NREL Renewable and Sustainable Energy Institute, and is the author of the textbook Fundamentals of Power Electronics, now in its second edition.','Professor','3034927003','rwe@colorado.edu','University of Colorado, ECOT 356 (Engineering Center, Office Tower, third floor)','/tmp/phpk03e9x','1',NULL,'2020-07-23 08:15:51','2020-07-23 08:15:51'),(6,'Giorgio Rizzoni','PhD','Giorgio Rizzoni, the Ford Motor Company Chair in Electromechanical Systems, is a Professor of Mechanical and Aerospace Engineering and of Electrical and Computer Engineering, and Director of the Center for Automotive Research (an interdisciplinary research center supporting some 30 full-time staff and 60 graduate students) at the Ohio State University. Prof. Rizzoni received B.S., M.S. and Ph.D. degrees in Electrical and Computer Engineering from the University of Michigan and is a Fellow of IEEE and SAE.','Professor','6146883856','rizzoni.1@osu.edu','201 W 19th Ave, E329 Scott Lab, Columbus, OH 43210','/tmp/phpUMAOFf','1',NULL,'2020-07-23 08:22:36','2020-07-23 08:23:34'),(7,'John Gregg','PhD','Professor J.Gregg is an established fellow & practicing tutor in Physics at the university of Oxford, in the United Kingdom.','Professor','01865272209','john.Gregg@physics.ox.ac.uk','Clarendon Laboratory, Parks Road, Oxford, OX1 3PU, United Kingdom','/tmp/phpJUiJ0S','1',NULL,'2020-07-23 10:43:25','2020-07-23 10:43:25'),(8,'Stan Gibilisco','PhD','Stan Gibilisco is a professional technical writer who specializes in books on electronics and science topics. He is the author of The Encyclopedia of Electronics, The McGraw-Hill Encyclopedia of Personal Computing, and The Illustrated Dictionary of Electronics, as well as over 20 other technical books. His published works have won numerous awards. The Encyclopedia of Electronics was chosen a \"Best Reference Book of the 1980s\" by the American Library Association, which also named his McGraw-Hill Encyclopedia of Personal Computing a \"Best Reference of 1996. Stan produced instructional, technical, and general interest videos on YouTube. Subjects include electronics, computers, physics, mathematics, alternative energy, and amateur radio.','Professor','111111','info@kambarage.com','South Dakota, USA','/tmp/phpVYMrAn','1',NULL,'2020-07-23 11:15:41','2020-07-23 11:29:59'),(9,'Phillip A. Laplante','PhD','Dr. Phillip A. Laplante is a professor of software engineering at Pennsylvania State University’s Great Valley School of Graduate Professional Studies.','Professor','111111','info@kambarage.com','Pennsylvania, USA','/tmp/php6jneU9','1',NULL,'2020-07-23 11:48:06','2020-07-23 11:48:43'),(10,'Jesse David Jennings','PhD','Jesse D. Jennings was born in Oklahoma City July 7, 1909, and died at his home in Siletz, Oregon, on August 13, 1997.','Professor','111111','info@kambarage.com','Siletz, Oregon','/tmp/phpxyuRKa','1',NULL,'2020-07-23 12:11:05','2020-07-23 12:11:05'),(11,'Forrest M. Mims III','Graduate','Forrest M. Mims III is an American amateur scientist, magazine columnist, and author of Getting Started in Electronics and Engineer\'s Mini-Notebook series of instructional books that were originally sold in Radio Shack electronics stores. Mims graduated from Texas A&M University in 1966 with a major in government and minors in English and history. He is also the Chairman of the Environmental Science Section of the Texas Academy of Science. He also teaches electronics and atmospheric science at the University of the Nations, an unaccredited Christian university in Hawaii.','Amateur Scientist','111111','info@kambarage.com','Houston, Texas, United States of America','/tmp/phpGqz1ax','1',NULL,'2020-07-23 13:26:04','2020-07-23 13:26:22'),(12,'Stephen King','Bachelor\'s Degree','Stephen Edwin King (born September 21, 1947) is an American author of horror, supernatural fiction, suspense, crime, science-fiction, and fantasy novels. His books have sold more than 350 million copies, and many have been adapted into films, television series, miniseries, and comic books.','Writer','111111','info@kambarage.com','Maine, USA','/tmp/phpikKSII','1',NULL,'2020-07-23 13:41:44','2020-07-23 13:41:44'),(13,'James Jeans','PhD','Sir James Hopwood Jeans OM FRS (11 September 1877 – 16 September 1946) was an English physicist, astronomer and mathematician. He made important contributions in many areas of physics, including quantum theory, the theory of radiation and stellar evolution. Jeans, along with Arthur Eddington, is a founder of British cosmology. In 1928, Jeans was the first to conjecture a steady state cosmology based on a hypothesized continuous creation of matter in the universe.','Scientist','111111','info@kambarage.com','Dorking, Surrey, England','/tmp/phpCgDbQm','1',NULL,'2020-08-17 12:46:41','2020-08-17 12:46:41'),(14,'Hisham Khatib','PhD','Hisham Khatib is Honorary Vice Chairman of the World Energy Council and a member of the World Federation of Scientists Energy Permanent Monitoring Panel. He is a founding member of the WEC Committee on Clean Fossil Fuels Studies, and the committee on Performance of Generating Plants. During the last twenty five years he has consulted to many international and regional development and environmental agencies on different aspects of energy, electrical power, water, local and global environmental issues. He has co-authored many books related to energy, including the UNDP/UNDESA/ WEC World Energy Assessment study \'Energy and the Challenge of Sustainability\'.','Doctor','111111','info@kambarage.com','Acre, Israel','/tmp/phplrEWc2','1',NULL,'2020-08-17 12:50:30','2020-08-17 12:50:30'),(15,'Benjamin Crowell','PhD','Benjamin Crowell teaches physics at Fullerton College, a community college in southern California. He is fully equipped with a PhD in physics from Yale, but he is more fondly remembered during his undergraduate years at UC Berkeley.','Doctor','111111','crowell@lightandmatter.com','2233 Loma Alta Dr. Fullerton, CA 92833','/tmp/phpbvVwch','1',NULL,'2020-08-17 12:54:11','2020-08-17 12:54:11'),(16,'Kyle Kirkland','PhD','NA','Doctor','111111','info@kambarage.com','Unknown','/tmp/phpsyqUF1','1',NULL,'2020-08-17 13:00:03','2020-08-17 13:00:03'),(17,'Lawrence M. Thompson','PhD','NA','Doctor','111111','info@kambarage.com','Unknown','/tmp/phpax7Vr9','1',NULL,'2020-08-17 13:01:22','2020-08-17 13:01:22'),(18,'Milton Gussow','Unknown','NA','Unknown','111111','info@kambarage.com','Unknown','/tmp/phpXrFWsi','1',NULL,'2020-08-17 13:04:21','2020-08-17 13:04:21'),(19,'Arthur Stanley Ramsey','PhD','Arthur Stanley Ramsey (9 September 1867 – 31 December 1954) was a British mathematician and author of mathematics and physics textbooks. He was Fellow of Magdalene College, Cambridge, and its President from 1915–52.','Doctor','111111','info@kambarage.com','Cambridge, UK','/tmp/phpFjF45R','1',NULL,'2020-08-17 13:09:13','2020-08-18 09:37:00'),(20,'National Geographic','Unknown','National Geographic is the official magazine of the National Geographic Society. It has been published continuously since its first issue in 1888, nine months after the Society itself was founded. It primarily contains articles about science, geography, history, and world culture.','Institute','111111','info@kambarage.com','California, USA','/tmp/phpAqQis8','1',NULL,'2020-08-17 13:12:40','2020-08-17 13:12:40'),(21,'Basil Mahon','Graduate','Basil Mahon is a former officer in the Royal Electrical and Mechanical Engineers and a graduate in Engineering. He is a retired Government Civil Servant and ran the 1991 census in England and Wales. He has a long-time passion for the physical sciences and has for many years been fascinated by the impact that Maxwell has had on all our lives.','Writer','111111','info@kambarage.com','England, UK','/tmp/phpIGJXQg','1',NULL,'2020-08-17 13:16:50','2020-08-17 13:16:50'),(22,'Paul A. Lynn','PhD','NA','Doctor','111111','info@kambarage.com','Unknown','/tmp/phppS2EIK','1',NULL,'2020-08-17 13:19:27','2020-08-17 13:19:27'),(23,'Simon Monk','PhD','Dr. Simon Monk has a degree in Cybernetics and Computer Science and a PhD in Software Engineering. Dr. Monk spent several years as an academic before he returned to industry, co-founding the mobile software company Momote Ltd. He has been an active electronics hobbyist since his early teens and is a full time writer on hobby electronics and open source hardware. Dr. Monk is the author of numerous electronics books, including Programming Arduino, Hacking Electronics, and Programming the Raspberry Pi.','Doctor','111111','info@kambarage.com','41 Dollywaggon Way Bamber Bridge PR5 6EW UK','/tmp/phpqgiEao','1',NULL,'2020-08-17 13:23:00','2020-08-17 13:23:00'),(24,'Chris Harris','PhD','Chris Harris is Honorary Fellow in Energy Policy at Exeter University, UK, following a period as Visiting Professor in Sustainable Power Distribution at Bath University, UK. He is Head of Regulation at RWE npower, with previous roles including heads of internal markets, asset optimization and asset management. He has PhDs in fracture mechanics and regulatory economics.','Professor','441752584901','chris.harris@plymouth.ac.uk','A226, 22 Portland Square, Drake Circus, Plymouth, PL4 8AA','/tmp/phpsDzEjZ','1',NULL,'2020-08-17 13:29:59','2020-08-17 13:29:59'),(25,'Dean. T. Mook','PhD','Prof. Dean T. Mook died peacefully with family at his bedside on Friday, June 19, 2020. Dean was the N. Waldo Harrison Professor Emeritus of Engineering Science and Mechanics at Virginia Tech, where he enjoyed a long, illustrious, and rewarding career.','Professor','111111','info@kambarage.com','Virginia, USA','/tmp/phpOcDpAC','1',NULL,'2020-08-17 13:33:27','2020-08-17 13:33:52'),(26,'Ali Hasan Nayfeh','PhD','Ali Hasan Nayfeh (21 December 1933 – 27 March 2017) was a Palestinian-Jordanian mathematician, mechanical engineer and physicist. He is regarded as the most influential scholar and scientist in the area of applied nonlinear dynamics in mechanics and engineering. He was the inaugural winner of the Thomas K. Caughey Dynamics Award, and was awarded the Benjamin Franklin Medal in mechanical engineering.','Professor','111111','info@kambarage.com','Amman, Jordan','/tmp/phpFLNlut','1',NULL,'2020-08-17 13:36:29','2020-08-17 13:36:39'),(27,'Dale R. Patrick','PhD','NA','Doctor','111111','info@kambarage.com','Unknown','/tmp/phpsAq8RR','1',NULL,'2020-08-17 13:39:08','2020-08-17 13:39:08'),(28,'Stephen W. Fardo','PhD','NA','Doctor','111111','info@kambarage.com','Richmond, KY 40475, USA','/tmp/phpwacKm2','1',NULL,'2020-08-17 13:42:03','2020-08-17 13:42:03'),(29,'David Penn Moreton','PhD','WAS AN ASSOCIATE PROFESSOR OF ELECTRICAL ENGINEERING AT ARMOUR\r\nINSTITUTE OF TECHNOLOGY, ASSOCIATE MEMBER OF THE AMERICAN INSTITUTE OF ELECTRICAL ENGINEERS, MEMBER\r\nOF THE SOCIETY FOR THE PROMOTION OF\r\nENGINEERING EDUCATION,','Professor','111111','info@kambarage.com','USA','/tmp/phpZ90c4L','1',NULL,'2020-08-17 13:45:58','2020-09-04 08:22:48'),(30,'Paolo Di Barba','PhD','He is currently at the Department of Electrical, Computer and Biomedical Engineering at the University of Pavia in Italy.','Professor','111111','info@kambarage.com','Pavia, Italy','/tmp/phpD02cXT','1',NULL,'2020-08-17 13:49:59','2020-08-17 13:55:14'),(31,'Antonio Savini','PhD','Antonio Savini PhD FIET is the Director of the Museum of Electrical Technology, University of Pavia, Italy.,He is professor of electrical engineering and the author or co-author over 250 works in the field of computer aided analysis and design in electromagnetism and of the history of electrical technology. In 1998 he founded the Research Centre for the History of Electrical Technology (CIRSTE) at the University of Pavia; since then he is the Director of this Centre.,Professor Savini holds memberships in various academies and professionals associations.','Professor','111111','info@kambarage.com','Pavia, Italy','/tmp/phpD20Aem','1',NULL,'2020-08-17 13:54:56','2020-08-17 13:54:56'),(32,'Sławomir Wiak','PhD','Sławomir Jan Wiak (born August 14, 1948 in Janówek) - is a Polish engineer, specialist in the field of electrical engineering, computer modeling and information systems, professor of technical sciences, full professor of the Lodz University of Technology and currently rector of this university in the 2016–2020 term.','Professor','111111','info@kambarage.com','Poland','/tmp/phpHj8XkY','1',NULL,'2020-08-17 14:00:48','2020-08-17 14:02:28'),(33,'Rex Miller','Unknown','NA','Unknown','111111','info@kambarage.com','Unknown','/tmp/phpWAWgWk','1',NULL,'2020-08-17 14:03:32','2020-08-17 14:03:32'),(34,'Mark R. Miller','Unknown','NA','Unknown','111111','info@kambarage.com','Unknown','/tmp/php0Or34R','1',NULL,'2020-08-17 14:27:37','2020-08-17 14:27:37'),(35,'Frank R. Spellman','Unknown','NA','Unknown','111111','info@kambarage.com','Unknown','/tmp/phpaekxth','1',NULL,'2020-08-17 14:30:17','2020-08-17 14:30:17'),(36,'Joanne Drinan','Unknown','NA','Unknown','111111','info@kambarage.com','Unknown','/tmp/phpupW1KQ','1',NULL,'2020-08-17 14:31:26','2020-08-17 14:31:26'),(37,'Vigyan Chandra','PhD','Professor & Coordinator\r\nCyber Systems Tec/Computer Networking Security & Electronics Programs','Professor','111111','info@kambarage.com','Richmond, Kentucky, USA','/tmp/phpNHBJ4w','1',NULL,'2020-08-17 16:38:46','2020-08-17 16:38:46'),(38,'Francis LeBlanc','PhD','Professeur du campus de Moncton','Professor','5068583781','francis.leblanc@umoncton.ca','Pavillon Léopold-Taillon 18, avenue Antonine-Maillet Local : 340','/tmp/phpu6pDN7','1',NULL,'2020-08-17 16:41:25','2020-08-17 16:41:25'),(39,'Karen Aplin','PhD','Office 2.34\r\nQueen\'s Building,\r\nUniversity Walk, Clifton BS8 1TR','Associate Professor','441174283371','karen.aplin@bristol.ac.uk','','/tmp/phpumroeF','1',NULL,'2020-08-17 16:43:42','2020-08-17 16:43:42'),(40,'Yoav Y. Yair','PhD','Interdisciplinary Center (IDC) Herzliya\r\nSchool of Sustainability\r\nAffiliation(s) within the IAU','Professor','97299527952','yoav.yair@idc.ac.il','Herzliya 46150 Israel','/tmp/phpx6Wqd8','1',NULL,'2020-08-17 16:46:51','2020-08-17 16:47:24'),(41,'R.G.Harrison','PhD','NA','Professor','111111','info@kambarage.com','Unknown','/tmp/phpVggtPh','1',NULL,'2020-08-18 05:24:10','2020-08-18 05:24:10'),(42,'J.P.Lebreton','Unknown','NA','Unknown','111111','info@kambarage.com','Unknown','/tmp/phphjyd75','1',NULL,'2020-08-18 05:25:04','2020-08-18 05:25:04'),(43,'M.Blanc','Unknown','NA','Unknown','111111','info@kambarage.com','Unknown','/tmp/phplGuDYG','1',NULL,'2020-08-18 05:25:40','2020-08-18 05:25:40'),(44,'François Lévêque','PhD','François Lévêque is a Professor of Economics at Mines ParisTech, PSL University. He is part-time Professor at the Robert Schuman Center for Advanced Studies (European University Institute, Florence). He published a dozen books and a hundred of academic papers in the areas of antitrust, industrial organization and energy. He founded a Paris based economic consulting firm, Microeconomics, which recently joined Deloitte.','Professor','111111','info@kambarage.com','Paris, France','/tmp/php01TcGZ','1',NULL,'2020-08-18 05:28:22','2020-08-18 05:28:22'),(45,'G. Randy Slone','Graduate','G. Randy Slone is an electronics engineer, a consultant, and author of five books, including High-Power Audio Amplifier Construction Manual and The TAB Guide to Understanding Electricity and Electronics. As a process control engineer, his consulting clients have included DuPont, Champion International, and Ralston Purina. A former college instructor, Slone is the owner/operator of SEAL Electronics, and the current senior design engineer for ZUS Audio Inc. He spends much of his time working in his state-of-the-art home electronics laboratory.','Writer','111111','info@kambarage.com','Unknown','/tmp/phpJMWERj','1',NULL,'2020-08-18 05:31:13','2020-08-18 05:31:13'),(46,'Gabriel Reuben','Unknown','NA','Unknown','111111','info@kambarage.com','Unknown','/tmp/phpnTPdNs','1',NULL,'2020-08-18 05:32:56','2020-08-18 05:32:56'),(47,'Geoffrey Rothwell','PhD','Geoffrey Rothwell is a senior lecturer in the Department of Economics at Stanford University and a senior research associate at the Stanford Institute for Economic Policy Research. He received his MS and PhD at the University of California, Berkeley. He is currently also working with the Nuclear Energy Agency, OECD','Professor','111111','info@kambarage.com','Stanford, USA','/tmp/phpdaspHt','1',NULL,'2020-08-18 05:37:00','2020-08-18 05:37:00'),(48,'Tomás Gómez','PhD','Tomás Gómez San Román is a professor of Electrical Engineering at the Engineering School of Universidad Pontificia Comillas in Madrid, Spain. Currently he is the Director of Instituto de Investigación Tecnológica (IIT) at Comillas.','Professor','111111','info@kambarage.com','Madrid, Spain','/tmp/phpxmTGzi','1',NULL,'2020-08-18 05:39:05','2020-08-18 05:39:05'),(49,'Jason Makansi','Graduate','Jason Makansi, Executive Director of the  Energy Storage Council and President of Pearl Street, Inc., is a Columbia University graduate in Chemical Engineering with two decades of experience evaluating the technological, business, and regulatory issues governing the entire electricity value chain.','Unknown','111111','info@kambarage.com','Las Vegas, USA','/tmp/php11buG5','1',NULL,'2020-08-18 05:42:44','2020-08-18 05:42:44'),(50,'Jim hayes','Graduate','Jim Hayes is a founder of the Structured Cabling Association and President of The Fiber Optic Association, the professional society for fiber optics. He is also a partner in VDV Works, a company that provides technical support to the voice-data-video industry. Originally educated as a physicist and astronomer at Vanderbilt University and The University of California at Santa Cruz. A frequent lecturer on communications, he writes monthly columns for Electrical Contractor and TED (The Electrical Distributor)','Unknown','111111','info@kambarage.com','USA','/tmp/phpa7NJJl','1',NULL,'2020-08-18 05:47:22','2020-08-18 05:47:22'),(51,'Paul Rosenberg','Graduate','Paul Rosenberg has an extensive background in the construction, data, electrical and fiber-optic trades. A leading voice in the electrical industry, he has years of experience spanning roles from apprentice to project manager. Rosenberg has written for leading electrical and low-voltage industry magazines and has authored more than 60 books. In addition, he wrote the first standard for the installation of optical cables in buildings (ANSI-NEIS-301) and was awarded a patent for a power transmission module. Rosenberg serves as a consultant and expert witness in legal cases and occasionally speaks at industry events.','Unknown','111111','info@kambarage.com','USA','/tmp/phpQpXNOd','1',NULL,'2020-08-18 05:49:17','2020-08-18 05:49:17'),(52,'John M. Studebaker','PhD','John Mohler Studebaker (10 October 1833 – 16 March 1917) was the Pennsylvania Dutch co-founder and later executive of what would become the Studebaker Corporation automobile company.','Professor','111111','info@kambarage.com','USA','/tmp/phpvAElSV','1',NULL,'2020-08-18 05:51:54','2020-08-18 06:29:49'),(53,'Max W. Carbon','Unknown','NA','Unknown','111111','info@kambarage.com','Unknown','/tmp/php9fyX2M','1',NULL,'2020-08-18 05:52:53','2020-08-18 05:52:53'),(54,'Paul Fleisher','Unknown','Paul Fleisher is the author of more than three dozen books for children and educators, as well as numerous articles and essays. He also worked as a teacher in the Richmond Public Schools Programs for Gifted for 27 years. Since retiring from that position, he has taught in the School of Education at Virginia Commonwealth University and served as assistant to the director of the Richmond Peace Education Center.','Unknown','111111','info@kambarage.com','Richmond, USA','/tmp/phpFhQd0g','1',NULL,'2020-08-18 05:55:46','2020-08-18 05:55:46'),(55,'Monica Greer','PhD','In addition to teaching at Bellarmine, Monica Greer is a Consultant for Humana, an integrated Health Care company. She works in the Medicare Advantage Actuarial department, specifically within the Infrastructure Development Support group.','Doctor','111111','info@kambarage.com','USA','/tmp/phphwddM2','1',NULL,'2020-08-18 05:59:12','2020-08-18 05:59:12'),(56,'Peter A. Lindemann','PhD','Peter Andrew Lindemann was born in Milwaukee, Wisconsin in 1951. In 2011, Peter teamed up with Aaron Murakami to found Tesla Chargers to sell John’s chargers.  Today, teslachargers.com is the largest distributor of John’s battery chargers and solar charge controllers in the world.\r\n\r\nIn 2009, Peter and Aaron founded A&P Electronic Media to begin publishing as much information on Free Energy topics as they could. Now, in 2015, A&P has a catalog of over 60 books and filmed lectures, by some of the most advanced researchers in this field.','Doctor','111111','info@kambarage.com','USA','/tmp/phpbs9Nvc','1',NULL,'2020-08-18 06:01:35','2020-08-18 06:01:50'),(57,'R. H. Warring','Unknown','NA','Unknown','111111','info@kambarage.com','USA','/tmp/phpWguJqH','1',NULL,'2020-08-18 06:03:57','2020-08-18 06:03:57'),(58,'Richard Cadena','Unknown','Richard Cadena is an author, freelance lighting designer/consultant, ETCP Recognized Trainer, ETCP Certified Entertainment Electrician, technical editor for PLASA Media, and the founder of the Academy of Production Technology. He has been in the lighting industry for over 30 years working as a tech, programmer, designer, electrician, account rep, and author. In addition to working on shows, he also teaches classes and workshops covering a variety of live event production-related topics including entertainment electrics, power distribution, control systems, and programming, he does public speaking','Unknown','111111','info@kambarage.com','USA','/tmp/php3NgO1o','1',NULL,'2020-08-18 06:07:11','2020-08-18 06:07:11'),(59,'Richard Munson','Unknown','Richard (Dick) Munson is an American author and clean energy advocate. His latest book, Tesla: Inventor of the Modern, was published by W.W. Norton in May 2018. Author of five other books with topics that range from U.S. government energy policy to profiles of tycoon George Fabyan and oceanographer Jacques Cousteau, Munson is also Director of Midwest Clean Energy for the Environmental Defense Fund, working primarily as a lobbyist for clean energy initiatives in Illinois and Ohio.','Unknown','111111','info@kambarage.com','Ohio, USA','/tmp/phpmpTY7I','1',NULL,'2020-08-18 06:09:10','2020-08-18 06:09:10'),(60,'Sally M. Walker','Graduate','Walker is a literature consultant and an author of nonfiction juvenile literature. Before becoming an author of children’s literature Walker has worked for Junction Book Store in DeKalb, IL as a children’s book buyer (1988–94). She was also employed with Anderson\'s Bookshops in Naperville, IL as a Children’s literature consultant (1988) as well as a children\'s book specialist (1994). For a short time Walker was an adjunct instructor for Northern Illinois University (1992–2005).','Writer','111111','info@kambarage.com','USA','/tmp/phpxRIsnQ','1',NULL,'2020-08-18 06:11:42','2020-08-18 06:11:42'),(61,'Steven Stoft','PhD','Steven Stoft has a Ph.D. in economics (U.C. Berkeley) as well as a background in physics, math, engineering, and astronomy. He spent a year inside FERC and now consults for PJM, California and private generators. Learn more at www.stoft.com','Professor','111111','info@kambarage.com','California, USA','/tmp/phpIm6nby','1',NULL,'2020-08-18 06:14:44','2020-08-18 06:14:44'),(62,'Juan M. Gers','PhD','Juan M. Gers obtained his BSc in Electrical Engineering at University of Valle, Colombia, in 1977. In 1981 he finished an MSc at the University of Salford in England and his PhD in 1998 at the University of Strathclyde in Scotland. He has been working as consulting engineer and university lecturer for over 30 years. Dr. Gers is a Chartered Engineer of the IET and Member of the IEEE.','Doctor','111111','info@kambarage.com','Scotland','/tmp/phpVzV15J','1',NULL,'2020-08-18 06:16:14','2020-08-18 06:18:10'),(63,'Edward J. Holmes','Bachelor\'s Degree','Ted Holmes graduated from Queen Mary, University of London in 1950 and joined the CEGB, where he worked for over 35 years. A Fellow of the IEE and a Chartered Engineer, he is co-author of the book Electricity Distribution Network Design. He passed away in July of 2006 after fighting a long illness.','Unknown','111111','info@kambarage.com','USA','/tmp/phpjW7bpi','1',NULL,'2020-08-18 06:17:09','2020-08-18 06:19:04'),(64,'United Nations (UN)','Unknown','The United Nations (UN) is an intergovernmental organization that aims to maintain international peace and security, develop friendly relations among nations, achieve international cooperation, and be a center for harmonizing the actions of nations. It is the largest, most familiar, most internationally represented and most powerful intergovernmental organization in the world. The UN is headquartered on international territory in New York City, with its other main offices in Geneva, Nairobi, Vienna and The Hague.','Unknown','111111','info@kambarage.com','New-york, USA','/tmp/php0P1HfH','1',NULL,'2020-08-18 06:21:04','2020-08-18 06:21:04'),(65,'William C. Robertson','Unknown','NA','Unknown','111111','info@kambarage.com','Unknown','/tmp/phpoZr6GC','1',NULL,'2020-08-18 06:25:47','2020-08-18 06:25:47'),(66,'William Kamkwamba','Unknown','William Kamkwamba (born August 5, 1987) is a Malawian inventor and author. He gained fame in his country in 2001 when he built a wind turbine to power multiple electrical appliances in his family\'s house in Wimbe, 32 km (20 mi) east of Kasungu, using blue gum trees, bicycle parts, and materials collected in a local scrapyard. Since then, he has built a solar-powered water pump that supplies the first drinking water in his village and two other wind turbines, the tallest standing at 12 meters (39 ft), and is planning two more, including one in Lilongwe, the political capital of Malawi.','Unknown','111111','info@kambarage.com','Malawi','/tmp/phpaPFOLM','1',NULL,'2020-08-18 06:27:35','2020-08-18 06:27:35'),(67,'Roland Palmquist','Unknown','NA','Unknown','111111','info@kambarage.com','Unknown','/tmp/php4d5QJF','1',NULL,'2020-08-18 06:56:40','2020-08-18 06:56:40'),(68,'Ella Newell','Unknown','NA','Unknown','111111','info@kambarage.com','USA','/tmp/phphp0Xn2','1',NULL,'2020-08-18 08:04:55','2020-08-18 08:04:55'),(69,'Tyler G. Hicks','Graduate','Tyler G. Hicks, P.E., is a consulting engineer and a successful engineering book author. He has worked in plant design and operation in a variety of industries, taught at several engineering schools, and\r\nlectured both in the United States and abroad. Mr. Hicks holds a\r\nbachelor’s degree in Mechanical Engineering from Cooper Union\r\nSchool of Engineering in New York. He is the author of more than\r\n100 books in engineering and related fields.','Unknown','111111','info@kambarage.com','USA','/tmp/phpSY7mFc','1',NULL,'2020-08-18 10:26:57','2020-08-18 10:30:13'),(70,'Ejup N. Ganić','PhD','Ejup Ganić (born 3 March 1946) is a Bosnian founder and chancellor of Sarajevo School of Science and Technology. He had served one term as President of the Federation of Bosnia and Herzegovina from 1997 to 2001. He holds a ScD (doctor of science) from Massachusetts Institute of Technology.','Professor','111111','info@kambarage.com','Bosnia','/tmp/phpkJz1gd','1',NULL,'2020-08-18 10:46:14','2020-08-18 10:46:14'),(71,'Forbes Journalists','PhD','Forbes is an American business magazine. Published biweekly, it features original articles on finance, industry, investing, and marketing topics. Forbes also reports on related subjects such as technology, communications, science, politics, and law. Its headquarters is located in Jersey City, New Jersey. Forbes has an international edition in Asia as well as editions produced under license in 27 countries and regions worldwide. The magazine is well known for its lists and rankings, including of the richest Americans (the Forbes 400), of the America\'s Wealthiest Celebrities, of the world\'s top companies (the Forbes Global 2000), 30 Under 30, World\'s 100 Most Powerful Women, and The World\'s Billionaires.','Writers','111111','info@kambarage.com','New Jersey, USA','/tmp/phpiTwjo1','1',NULL,'2020-08-21 01:02:33','2020-08-21 02:34:58'),(72,'OECD Journalists','Unknown','The Organisation for Economic Co-operation and Development (OECD) is an international organisation that works to build better policies for better lives. Our goal is to shape policies that foster prosperity, equality, opportunity and well-being for all. We draw on almost 60 years of experience and insights to better prepare the world of tomorrow.','Writers','111111','info@kambarage.com','Unknown','/tmp/phpepO3tp','1',NULL,'2020-09-02 14:56:53','2020-09-02 14:56:53'),(73,'Oxford University Press (OUP)','Graduates','Oxford University Press (OUP) is the largest university press in the world, and the second oldest after Cambridge University Press. It is a department of the University of Oxford and is governed by a group of 15 academics appointed by the vice-chancellor known as the delegates of the press. They are headed by the secretary to the delegates, who serves as OUP\'s chief executive and as its major representative on other university bodies. Oxford University Press has had a similar governance structure since the 17th century.','Writers','111111','info@kambarage.com','Oxford, England','/tmp/phpqoDCbP','1',NULL,'2020-09-04 15:01:33','2020-09-04 15:01:33');
