INSERT INTO `book` VALUES (1,1,2,2,'Adaptive Filtering with Primer','Adaptive Filtering with Primer',NULL,'Because of the wide use of adaptive filtering in digital signal processing and, because most of the modern electronic devices include some type of an adaptive filter, a text that brings forth the fundamentals of this field was necessary. The material and the principles presented in this book are easily accessible to engineers, scientists, and students who would like to learn the fundamentals of this field and have a background at the bachelor level.','pdf','1','Electricity.','2','31','142000638X','9781420006384','','','2020-02-14','/tmp/phpt1KmZQ','/tmp/php2JnbEP',NULL,'/tmp/phpBn8Dvv','/tmp/phpxyrpX4','202',1,0,0,0,0,'1',0,0,NULL,'2020-07-22 08:09:11','2020-09-02 12:31:53'),(2,1,2,4,'Anatomy of a Robot','Anatomy of a Robot',NULL,'This work looks under the hood of all robotic projects, stimulating teachers, students, and hobbyists to learn more about the gamut of areas associated with control systems and robotics. It offers a unique presentation in providing both theory and philosophy in a technical yet entertaining way.','pdf','1','* Sensors * Algorithms * Plans * Controls * Systems * Quality * Computers * Power * Actuators * Project Management * Reliability * Artificial Intelligence * Feedback','2','32','10.1036/0071429301','978-0071416573','','','2003-04-22','/tmp/phpfRuuKc','/tmp/phpdMwEP9',NULL,'/tmp/phpKSO1U6','/tmp/phpknSU33','321',1,0,0,0,0,'1',1,0,NULL,'2020-07-23 10:33:03','2020-07-23 10:33:03'),(3,7,13,8,'The Illustrated Dictionary of Electronics','The Illustrated Dictionary of Electronics',NULL,'This updated dictionary of electronics terms covers a broader range of subjects in an easier-to-use format than any other source of its kind. No comparable reference offers such a vast range of definitions, abbreviations, acronyms, illustrations, schematics, diagrams, and conversion tables. More than 28,000 definitions--plus over 1,000 clear and functional illustrations--make the Eighth Edition the ultimate reference for technicians, hobbyists, and students.','pdf','8','Illustrated Dictionary of Electronics Eighth Edition','2','32','NA','978-0071372367','NA','NA','2020-05-07','/tmp/phpWTQrpn','/tmp/php7o02KG',NULL,'/tmp/phpH1gI6Z','/tmp/phpY6Uvvj','791',1,0,0,0,0,'1',0,0,NULL,'2020-07-23 11:28:05','2020-08-18 16:40:37'),(4,7,13,9,'Comprehensive Dictionary of Electrical Engineering','Comprehensive Dictionary of Electrical Engineering',NULL,'The Comprehensive Dictionary of Electrical Engineering is a complete lexicon covering all the fields of electrical engineering.The book provides workable definitions for practicing engineers, serves as a reference and research tool for students, and offers practical information for scientists and engineers in other disciplines.','pdf','1','Comprehensive Dictionary Electrical Engineering','2','31','0849331285','978-0849331282','NA','NA','2019-12-23','/tmp/phpsrJvC8','/tmp/phpsYfxad',NULL,'/tmp/phpaM4LIh','/tmp/phpVKudjm','720',1,0,0,0,0,'1',0,0,NULL,'2020-07-23 11:56:47','2020-08-18 16:40:12'),(5,1,2,5,'Fundamentals of Power Electronics','Fundamentals of Power Electronics',NULL,'The materials below are intended to be used by instructors of power electronics classes who have adopted Fundamentals of Power Electronics as a text. It is intended for use in introductory power electronics courses at the senior and first-year graduate level. It is also intended as a\r\nsource for professionals working in power electronics, power conversion, and analog electronics.','pdf','1','Fundamentals of Power Electronics Notes','2','35','NA','NA','NA','NA','2002-04-25','/tmp/phpMKGyaW','/tmp/phpdJPOWf',NULL,'/tmp/phpPjK7Iz','/tmp/phpDOdMxT','1326',1,0,0,0,0,'1',0,0,NULL,'2020-07-23 12:42:19','2020-07-23 12:42:19'),(6,1,2,10,'Introduction to Medical Electronics Applications','Introduction to Medical Electronics Applications',NULL,'Medical electronics, or more specifically the instrumentation used in physiological measurement, has changed significantly over the last few years. Developments in electronics technology have offered new and enhanced applications, especially in the areas of data recording and analysis and imaging technology. These changes have been accompanied by more stringent legislation on safety and liability. This book is designed to meet the needs of students on the growing number of courses, undergraduate and MSc.','pdf','1','Anatomy and Physiology. Physics. Physiological Instrumentation','2','33','NA','978-0340614570','NA','NA','1995-03-17','/tmp/phpE2znov','/tmp/php99sOoo',NULL,'/tmp/phpDZruph','/tmp/phpaKMBva','232',1,0,0,0,0,'1',1,0,NULL,'2020-07-23 12:47:50','2020-07-23 12:47:50'),(7,1,2,7,'Spin Electronics','Spin Electronics',NULL,'For 50 years conventional electronics has ignored the electron spin. The manipulation and utilisation of the electron spin heralds an exciting and rapidly changing era in electronics, combining the disciplines of magnetism and traditional electronics. The first generation of \"spintronic\" devices (such as read heads based on giant magnetoresistance or non-volatile magnetic random access memories) have already gained dominant positions in the market place','pdf','1','magnetism. semiconductor basics. micro-magnetism. experimental techniques, material science, device fabrication.  new developments in spin-dependent processes.','2','36','10.1007/3-540-45258-3','978-3-540-45258-4','569','NA','2001-01-01','/tmp/phpqJs82e','/tmp/phpykYxyA',NULL,'/tmp/phpaSz03V','/tmp/phpmzT9Dh','493',1,0,0,0,0,'1',0,1,NULL,'2020-07-23 12:55:57','2020-09-02 12:32:09'),(8,1,2,6,'Principles and Applications of Electrical Engineering','Principles and Applications of Electrical Engineering',NULL,'The hallmark feature of the text is its liberal use of practical applications to illustrate important principles. The applications come from every field of engineering and feature exciting technologies such as Ohio State’s world-record setting electric car. The appeal to non-EE’s is further heightened by such special features as the book’s Focus on Measurement sections, Focus on Methodology sections, and Make the Connection sidebars.','pdf','5','Electrical engineering. Principles.','2','32','NA','978-0073220338','NA','NA','2005-12-13','/tmp/phpX7BKnl','/tmp/phpkVBWfw',NULL,'/tmp/phpBldb8G','/tmp/php24695R','965',1,0,0,0,0,'1',0,0,NULL,'2020-07-23 13:05:21','2020-09-02 12:33:31'),(9,1,2,3,'Electromagnetics Explained','Electromagnetics Explained',NULL,'Based on familiar circuit theory and basic physics, this book serves as an invaluable reference for both analog and digital engineers alike. For those who work with analog RF, this book is a must-have resource. With computers and networking equipment of the 21st century running at such high frequencies, it is now crucial for digital designers to understand electromagnetic fields, radiation and transmission lines.','pdf','1','ELECTROMAGNETIC SPECTRUM. ELECTRIC FIELDS. MAGNETIC FIELDS','2','34','NA','978-0750674034','NA','NA','2020-05-27','/tmp/phpq1ired','/tmp/phpEoJxcm',NULL,'/tmp/phpzWsFav','/tmp/phpWKtLbE','376',1,0,0,0,0,'1',0,1,NULL,'2020-07-23 13:16:42','2020-08-18 07:00:30'),(10,1,2,11,'Getting Started in Electronics','Getting Started in Electronics',NULL,'This is a complete electronics course in 128 pages! Author Forrest Mims teaches you the basics, takes you on a tour of analog and digital components, explains how they work, and shows you how they are combines for various applications. Includes circuit assembly tips and 100 electronic circuits and projects you can build and test.','pdf','1','electronics. introduction. getting started. beginner.','2','35','NA','978-0945053286','NA','NA','2003-02-01','/tmp/phph65Ek1','/tmp/phpRiodza',NULL,'/tmp/phpnhePNj','/tmp/phpgy2lbt','128',1,0,0,0,0,'1',0,0,NULL,'2020-07-23 13:31:51','2020-07-23 13:31:51'),(12,4,6,12,'Dreamcatcher','Dreamcatcher',NULL,'A dark and sweeping adventure, Dreamcatcher is set in the haunted city of Derry - the site of Stephen King\'s It and Insomnia. In it, four young boys stand together and do a brave, good thing, an act that changes them in ways that they hardly understand. A quarter-century later, as grown men who have gone their separate ways, these friends come together once a year to hunt in the woods of Maine. This particular year, a stranger stumbles into their campsite, and before long, the friends are plunged into the most remarkable adventure of their lives. They wind up in a life and death struggle, their only hope for survival locked in their shared past... and in the dreamcatcher.','pdf','1','Sci-FI. Aliens','2','38','NA','0-7432-2188-5','NA','NA','2001-01-01','/tmp/php5QyoxW','/tmp/phpMAEXla',NULL,'/tmp/phpRevZao','/tmp/phpl5f31B','628',1,0,0,0,0,'1',1,1,NULL,'2020-07-23 14:04:04','2020-07-23 14:04:04'),(13,4,8,12,'Everything’s Eventual: 14 Dark Tales','Everything’s Eventual: 14 Dark Tales',NULL,'The first collection of stories Stephen King has published since Nightmares & Dreamscapes nine years ago, Everything\'s Eventual includes one O. Henry Prize winner, two other award winners, four stories published by The New Yorker, and \"Riding the Bullet,\" King\'s original e-book, which attracted over half a million online readers and became the most famous short story of the decade.','pdf','1','short stories.','2','38','NA','0-7432-3704-8','NA','NA','2020-01-01','/tmp/phpiN02lG','/tmp/phpSpI5aj',NULL,'/tmp/phpRibh0V','/tmp/phpR8EvQy','447',1,0,0,0,0,'1',1,0,NULL,'2020-07-23 14:14:26','2020-07-23 14:15:07'),(14,4,6,12,'Just After Sunset','Just After Sunset',NULL,'Just after sunset—call it dusk; call it twilight; it’s a time when human life takes on an unnatural cast, when nothing is quite as it appears, when the imagination begins to reach for shadows as they dissipate to darkness and living daylight can be scared right out of you.','pdf','1','Introduction Willa The Gingerbread Girl Harvey’s Dream Rest Stop Stationary Bike The Things They Left Behind Graduation Afternoon N. The Cat from Hell The New York Times at Special Bargain Rates Mute Ayana A Very Tight Place Sunset Notes','2','38','NA','1416584080','NA','NA','2008-11-11','/tmp/phpZkptoF','/tmp/phpTNWtWL',NULL,'/tmp/phpDJCwuS','/tmp/phplMZ22Y','244',1,0,0,0,0,'1',0,1,NULL,'2020-07-23 14:22:12','2020-07-23 14:22:12'),(15,4,6,12,'The Breathing Method','The Breathing Method',NULL,'There is a strange club in New York where men tell each other stories. The years pass but no one looks any older. One night a doctor tells the story of a young woman who gives birth to a baby in the most horrible way! Evil psychic powers, obsession and the supernatural in the most ordinary, everyday places. A spine-chiller from the master of horror.','pdf','1','Evil psychic powers, obsession and the supernatural in the most ordinary, everyday places','2','39','NA','0582418135','NA','NA','1999-12-20','/tmp/php8Itg4L','/tmp/phpjQKv6V',NULL,'/tmp/phpc3KW85','/tmp/phphSyGfg','68',1,0,0,0,0,'1',0,1,NULL,'2020-07-23 14:32:04','2020-07-23 14:32:04'),(16,4,9,12,'The Regulators','The Regulators',NULL,'It’s a gorgeous midsummer afternoon along Poplar Street in the peaceful suburbia of Wentwort, Ohio, where life is as pleasant as you ever dreamed it could be. But that’s all about to end in blaze of gunfire and sudden violence, forever shattering the tranquility and the good times here.','pdf','1','Seth Garin. Horror. Imagination. Violence','2','40','NA','978-1501143755','NA','NA','1996-01-01','/tmp/phpAWiDcm','/tmp/phpGp0Ctw',NULL,'/tmp/phpqVmEKG','/tmp/phpJoYx2Q','464',1,0,0,0,0,'1',0,0,NULL,'2020-08-13 11:49:40','2020-08-13 11:49:40'),(19,1,2,51,NULL,'House Wiring',NULL,'Now fully updated to cover home networking and other 21st century developments, this all-new edition gives you the guidelines, rules, and step-by-step instructions you need to do the job safely and with confidence.\r\n* Understand how to use the National Electrical Code (NEC) and meet its requirements\r\n* Install a safe electrical service entrance and branch circuits\r\n* Use the appropriate cables, wires, conduits, and boxes for your home\'s needs\r\n* Find specialized information about electric heating, mobile home wiring, and other unique applications\r\n* Learn to install wiring for cable TV, telephones, broadband Internet, home networks, and security systems\r\n* Be able to make accurate load calculations','pdf','8','Electrical. Electricity. House wiring','2','47','','978-0764569562','','','2020-07-23','/tmp/phpRV8Pmt',NULL,NULL,'/tmp/phpPBJD2j',NULL,'240',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 06:54:46','2020-08-18 06:59:58'),(20,1,2,13,NULL,'Science and Music',NULL,'Distinguished physicist describes the scientific principles of musical sound in a non-technical way: development of human hearing, properties of sound curves, transmission and reproduction of sound curves, more. Includes 75 illustrations.','pdf','1','Human Hearing. Sound Curves. Sound Transmission.','2','45','','978-1-108-00569-2','','','1937-01-01','/tmp/phpyRFl6v',NULL,NULL,'/tmp/phpSAyYsm',NULL,'285',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 07:10:17','2020-08-18 07:10:17'),(22,1,2,13,NULL,'The Mysterious Universe',NULL,'The Mysterious Universe is a popular science book by the British astrophysicist Sir James Jeans, first published in 1930 by the Cambridge University Press. In the United States, it was published by Macmillan.The book is an expanded version of the Rede Lecture delivered at the University of Cambridge in 1930. It begins with a full-page citation of the famous passage in Plato\'s Republic, Book VII, laying out the allegory of the cave. The book made frequent reference to the quantum theory of radiation, begun by Max Planck in 1900, to Albert Einstein\'s general relativity, and to the new theories of quantum mechanics of Heisenberg and Schrödinger, of whose philosophical perplexities the author seemed well aware.','pdf','1','Rede Lecture. Universe. Quantum Theory.','2','45','','978-1-108-00566-1','','','1930-01-01','/tmp/phphrmBl4',NULL,NULL,'/tmp/php0xitXU',NULL,'158',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 07:39:26','2020-08-18 07:39:26'),(23,1,2,14,NULL,'Economic Evaluation of Projects in the Electricity Supply Industry',NULL,'In a highly capital-intensive environment such as the electricity supply industry, it is essential that those working in the electrical power field - on either the engineering or management side - understand the methodologies of evaluating projects in order to fully comprehend and analyse investment proposals and decisions. This new book, a substantially revised and updated edition of the author\'s previous work \"Financial and Economic Evaluation of Projects in the Electricity Supply Industry\" (IEE/1996), takes a broad introductory approach and includes extensive consideration of market and environmental issues. It introduces the reader to the tools and techniques of financial analysis and evaluation, as well as clean environmental technologies and costs. New topics introduced include electricity trading and risk management, evolving electricity utilities, and new and future generation technologies in a carbon-constrained world.','pdf','2','Economic Evaluation. Electricity. Demand and Supply','2','41','','9780863413049','','','2003-08-31','/tmp/php5ENkU4',NULL,NULL,'/tmp/phpp8Zwed',NULL,'223',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 07:51:17','2020-08-18 07:51:17'),(24,1,2,68,NULL,'Turn On The Light: How Electricity Works',NULL,'You flip a switch, and a lightbulb glows. Your computer lights\r\nup when you turn it on. Do you know why? What keeps\r\nrefrigerators cool? What heats water? The answer is electricity.\r\nThis book tells the story of electricity’s amazing journey from\r\na huge power plant to the lights in your house.','pdf','','Electricity. Transmission. Kid explore.','2','42','','978-1612362335','','','2020-04-01','/tmp/phpICit4E',NULL,NULL,'/tmp/phpl6B8Ic',NULL,'47',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 08:12:51','2020-08-18 08:19:03'),(26,1,2,15,NULL,'Optics',NULL,'The Light and Matter series of introductory physics textbooks contains:\r\n1 Newtonian Physics\r\n2 Conservation Laws\r\n3 Vibrations and Waves\r\n4 Electricity and Magnetism\r\n5 Optics\r\n6 The Modern Revolution in Physics','pdf','2.1','Newtonian Physics. Conservation Laws. Vibrations and Waves. Electricity and Magnetism. Optics .The Modern Revolution in Physics','2','35','','0-9704670-5-2','','','2004-05-19','/tmp/phpTwqeHp',NULL,NULL,'/tmp/phpjQ71ja',NULL,'98',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 08:29:23','2020-08-18 08:29:23'),(27,1,2,16,NULL,'Particles and the Universe',NULL,'Discusses the advances in physics since Newton\'s observations, including nuclear physics, particle physics, quantum mechanics, and cosmology.','pdf','1','nuclear physics. particle physics. quantum mechanics. cosmology','2','43','','978-0-8160-6116-7','','','2007-01-01','/tmp/php5RC5GG',NULL,NULL,'/tmp/phpYiE6dg',NULL,'177',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 08:36:54','2020-08-18 08:36:54'),(28,1,2,17,NULL,'Industrial Data Communications',NULL,'The objectives of the fourth edition are exactly the same as those of the previous ones: to\r\nintroduce the principles and applications of industrial data communications and bring you\r\nto a level where you can communicate with other professionals on this topic. Because of\r\nthe changes in this field, particularly since the third version, this book assumes you are\r\nfamiliar with Internet use and perhaps some data communications applications. It is written\r\nin the same conversational style as its predecessors, with the hope that this informality\r\nmaximizes your understanding.','pdf','4','Principles of Industrial Data Communications','2','44','','978-1-934394-24-3','','','2008-01-01','/tmp/phpc4CilJ',NULL,NULL,'/tmp/phpGYPUmi',NULL,'285',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 08:42:57','2020-08-18 08:42:57'),(29,1,2,18,NULL,'Schaum\'s Outline of Basic Electricity',NULL,'Millions of students trust Schaum\'s Outlines to help them succeed in the classroom and on exams. Schaum\'s is the key to faster learning and higher grades in every subject. Each Outline presents all the essential course information in an easy-to-follow, topic-by-topic format. You also get hundreds of examples, solved problems, and practice exercises to test your skills.\r\nThis Schaum\'s Outline gives you:\r\n\r\nNew and expanded chapters-along with new sample problems throughout\r\nA complete grounding in electricity to technicians in fields including computer repair, telephone installation and repair, and auto mechanics','pdf','2','Electricity.','2','32','','978-0-07-170250-8','','','2007-01-01','/tmp/phpJkVoBE',NULL,NULL,'/tmp/phpyiltLU',NULL,'572',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 08:50:24','2020-08-18 08:50:24'),(30,1,2,13,NULL,'Problems of Cosmology and Stellar Dynamics',NULL,'Problems of Cosmogony and Stellar Dynamics is a theoretical prelude to Jeans\'s later and more mature work on the subject, Astronomy and Cosmogony. The impetus for publishing his theories on the behaviour of rotating masses, and on general dynamical theory, was the 1917 Adams Prize on the \'rotating and gravitating fluid mass\'. Jeans won the prize with the core text of this volume. Enlarging on that work, and utilising the burgeoning results of astronomy, as well as the author\'s bolder theoretical conjectures, this book became a solid foundation for substantial progress in cosmology.','pdf','1','Cosmology. Stellar Dynamics. Electricity','2','45','','978-1-108-00568-5','','','1919-01-01','/tmp/phpiiO5Id',NULL,NULL,'/tmp/phpeI2geb',NULL,'311',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 09:06:35','2020-08-18 09:06:35'),(31,1,2,19,NULL,'Electricity and Magnetism: An Introduction to the Mathematical Theory',NULL,'The knowledge of\r\npure mathematics assumed in the present volume amounts to\r\nlittle more than some elementary calculus and a few properties\r\nof vectors. The ground is restricted by this limitation. It\r\ncovers the schedule for Part I of the Tripos, including the\r\nfundamental principles of electrostatics, Gauss\'s theorem,\r\nLaplace\'s equation, systems of conductors, homogeneous\r\ndielectrics and the theory of images; steady currents in wires;\r\nelementary theory of the magnetic field and the elementary\r\nfacts about the magnetic fields of steady currents. There are\r\nalso short chapters on induced magnetism and induction of\r\ncurrents.','pdf','1','Electricity. Magnetism','2','45','','978-1-108-00259-2','','','1937-01-01','/tmp/phpqPdE39',NULL,NULL,'/tmp/php1DiZlp',NULL,'284',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 09:27:53','2020-08-18 09:27:53'),(32,1,2,13,NULL,'Physics and Philosophy',NULL,'This book presents a exposition of the philosophical implications of scientific knowledge, considered anew in light of 20th-century physics.','pdf','','Physics, Philosophy. 20th Century.','2','45','','978-1-108-00567-8','','','1942-01-01','/tmp/phpBwYS4s',NULL,NULL,'/tmp/phpUcDBVK',NULL,'235',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 09:32:04','2020-08-18 09:32:04'),(33,1,2,13,NULL,'The New Background of Science',NULL,'Broad outline of theoretical physics in simple terms against a background of rudimentary philosophy of the 20th Century','pdf','1','Theoretical Physics. Rudimentary Philosphy. 20th Century','2','45','','978-1-108-00572-2','','','1970-01-01','/tmp/phprfCZx2',NULL,NULL,'/tmp/phpDAcaJM',NULL,'325',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 09:36:47','2020-08-18 09:36:47'),(34,4,10,21,NULL,'Oliver Heaviside: Maverick mastermind of electricity',NULL,'I hope this book will leave readers feeling glad to have met Oliver Heaviside. His\r\nbest friend described him as ‘a first-rate oddity’. I agree – with a heavy emphasis on\r\n‘first-rate’.','pdf','1','Autobiography','2','41','','978-0-86341-965-2','','','2020-01-01','/tmp/phpNTrSg2',NULL,NULL,'/tmp/php6xlKOh',NULL,'183',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 09:47:35','2020-08-18 09:48:46'),(35,1,2,15,NULL,'Newtonian Physics',NULL,'Matter moves at constant speed in a straight line unless a force acts on it. (This seems\r\nintuitively wrong only because we tend to forget the role of friction forces.) Material objects can exert forces on\r\neach other, each changing the other’s motion. A more massive object changes its motion more slowly in response to a given force. This book explains more.','pdf','2.1','Electricity. Introductory Physics','2','35','','0-9704670-1-X','','','2002-01-01','/tmp/phpcjX8RX',NULL,NULL,'/tmp/phpIgvnow',NULL,'230',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 09:56:47','2020-08-18 09:56:47'),(36,1,2,15,NULL,'Conservation Laws',NULL,'This book contains 5 chapters that revolve around conservation laws in physics. Accomponied with questions and answers of the various problems within the books. Illustrations highly done for better understanding.','pdf','2.1','Physics','2','35','','0-9704670-2-8','','','2002-07-31','/tmp/phpWGnTpa',NULL,NULL,'/tmp/phpMjgvrO',NULL,'132',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 10:03:15','2020-08-18 10:03:15'),(37,1,2,15,NULL,'Vibrations and Waves',NULL,'Complied sub topics on Vibrations and Waves. It comprises illustrated examples and packed with questions and answers for the student and teachers to practice and thus master the discipline.','pdf','2.0','Physics.','2','35','','0-9704670-3-6','','','2002-06-03','/tmp/phpmDACKG',NULL,NULL,'/tmp/php0NszG5',NULL,'92',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 10:12:38','2020-08-18 10:12:38'),(38,1,2,15,NULL,'Electricity and Magnetism',NULL,'This book contains 6 chapters that revolve around conservation laws in physics. Accomponied with questions and answers of the various problems within the books. Illustrations highly done for better understanding.','pdf','2.1','Physics','2','35','','0-9704670-4-4','','','2002-10-30','/tmp/phpttqluS',NULL,NULL,'/tmp/phpIA3b3Z',NULL,'164',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 10:20:28','2020-08-18 10:20:28'),(39,1,1,69,NULL,'Civil Engineering Formulas - Pocket Guide',NULL,'Indispensable portable reference for all practicing civil engineers and studentsNow you can get a single compilation of all essential civil engineering formulas and equations in one easy-to-use portable reference. More than three-quarters of the material in Tyler Hicks Civil Engineering Formulas Pocket Guide is in the form of formulas, tables, and graphs, presented in SI and USCS formats. Each chapter, offering collections of problems and calculations, gives you quick reference to a well-defined topic','pdf','1','','2','32','','9780071356121','','','2020-01-01','/tmp/phpWgVrS0',NULL,NULL,'/tmp/phpYahU5O',NULL,'480',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 10:37:01','2020-08-18 10:37:40'),(40,1,1,69,NULL,'Civil Engineering Formulas - Pocket Guide',NULL,'Instant Access to Civil Engineering Formulas\r\nFully updated and packed with more than 500 new formulas, this book offers a single compilation of all essential civil engineering formulas and equations in one easy-to-use reference. Practical, accurate data is presented in USCS and SI units for maximum convenience. Follow the calculation procedures inside Civil Engineering Formulas, Second Edition, and get precise results with minimum time and effort. Each chapter is a quick reference to a well-defined topic','pdf','2','Formulas.','','32','','978-0-07-161470-2','','','2010-01-01','/tmp/phpv6ojvA',NULL,NULL,'/tmp/phpBRQ6j5',NULL,'414',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 10:42:12','2020-08-18 10:42:12'),(41,1,1,69,NULL,'McGraw-Hill\'s Engineering Companion',NULL,'Here are the tables, formulas, charts, diagrams, figures, key methods and worked-out problems engineers in design, product development, operation, production, analysis, and economic evaluation must have for successful day-to-day problem solving.\r\n\r\nThis dynamic one-volume database provides reliable, ready-to-apply solutions to literally hundreds of engineering problems—formatted for convenient instant access and carefully culled from McGraw-Hill’s most popular and respected handbooks, textbooks, and specialized technical books.','pdf','1','Formulas.','2','32','','9780071378369','','','2020-01-01','/tmp/phpk8x2e1',NULL,NULL,'/tmp/phplZ3WBf',NULL,'973',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 10:52:08','2020-08-18 12:49:06'),(42,1,2,16,NULL,'Electricity and Magnetism',NULL,'Each volume within this book explains the basic concepts of the subject and then discusses a variety of applications in which these concepts apply. Although physics is a mathematical subject, the focus of these books is on the ideas rather than the mathematics. Only simple equations are included. The reader does not need any special knowledge of mathematics, although an understanding of elementary algebra would be helpful in a few cases. The number of possible topics for each volume is practically limitless, but there is only room for a sample; regrettably, interesting applications had to be omitted.','pdf','1','Electricity. Magnetism','2','43','','978-0-8160-6112-9','','','2007-01-02','/tmp/php2T8PZK',NULL,NULL,'/tmp/php7tB8TG',NULL,'161',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 11:38:47','2020-08-18 11:38:47'),(43,1,2,45,NULL,'Understanding Electricity and Electronics',NULL,'Understanding Electricity and Electronics has been designed to be the best “first book” for anyone interested in becoming proficient in the electrical/electronics fields. The beginning chapters provide guidance in establishing an inexpensive electronics workplace and in acquiring all of the informational and mechanical tools needed','pdf','2','Electricity. Electronics','2','32','','0-07-138665-3','','','2020-02-05','/tmp/phphMe5lH',NULL,NULL,'/tmp/phpC4J7zt',NULL,'479',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 11:44:18','2020-08-18 12:34:33'),(45,1,2,24,NULL,'Electricity Markets: Pricing, Structures and Economics',NULL,'All stages of market development are equally important and in this book greatest attention will be paid to the design and structure of mature markets, and the role of regulation in implementing policy in a competitive marketplace. This is where the leading edge is, and developing markets will set much store from the experiences learned in the more mature markets. ‘Markets’ are interpreted in a wide sense, to include charging mechanisms, incentives and policy instruments such as taxes.The book is structured so that the chapters can be read in any order, according to the particular interest of the reader.','pdf','1','Electricity. Markets. Economics.','2','47','','978-0-470-01158-4','','','2006-01-02','/tmp/phpi1yIUm',NULL,NULL,'/tmp/phpQsnQD7',NULL,'544',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 12:12:25','2020-08-18 12:12:25'),(46,1,2,33,NULL,'Electrician\'s Pocket Manual',NULL,'The purpose of this book is to aid you in your everyday tasks and keep you updated with the latest facts, figures, and devices in this important trade. Many illustrations are included, which show a variety of parts and techniques found in present day practice in the field.  Information in this edition has been updated to reflect changes in the latest edition of the National Electrical Code (also known as the Code)','pdf','2','Electricity.','2','32','','0-07-158915-5','','','2005-01-04','/tmp/phpg7AZRS',NULL,NULL,'/tmp/phpDTY0P4',NULL,'402',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 12:18:16','2020-08-18 12:18:16'),(47,1,2,27,NULL,'Electronic Digital System Fundamentals',NULL,'Electronic Digital Systems Fundamentals is an introductory text that provides coverage of the various topics in the field of digital electronics. The key concepts presented in this book are discussed using a simplified approach that greatly enhances learning. The use of mathematics is kept to the very minimum and is discussed clearly through applications and illustrations','pdf','1','Electronics.','2','50','','1-4200-6774-5','','','2008-01-02','/tmp/phpPuvUun',NULL,NULL,'/tmp/phpWK6Lyz',NULL,'349',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 12:22:49','2020-08-18 12:22:49'),(48,1,2,44,NULL,'Competitive Electricity Markets and Sustainability',NULL,'The French Regulatory Commission for Energy (Commission de Régulation de l’Energie: CRE) found it useful to promote academic research by prominent specialists of the liberalisation process in electricity markets. This book is the result of that research. The CRE is indebted to the authors for their very interesting analyses of the investment decision-making process and of the possibility of reconciling the perhaps diverging interests of two major parts of the electric industry.','pdf','1','Electricity. Markets.','2','49','','978-1-84542-921-8','','','2006-01-03','/tmp/phpk2fYKK',NULL,NULL,'/tmp/phpLlf9Rn',NULL,'316',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 12:29:47','2020-08-18 12:29:47'),(49,1,2,16,NULL,'Force and motion',NULL,'Physics in Our World is a set of volumes that aims to explore the whole spectrum of applications, describing how physics influences technology and society, as well as helping people understand the nature and behavior of the universe and all its many interacting parts. Each volume explains the basic concepts of the subject and then discusses a variety of applications in which these concepts apply.','pdf','1','Physics.','2','43','','978-0-8160-6111-2','','','2007-01-02','/tmp/phpMOoW20',NULL,NULL,'/tmp/phpzFMYdE',NULL,'177',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 12:40:24','2020-08-18 12:40:24'),(50,1,2,27,NULL,'Electrical Distribution Systems',NULL,'Electrical Distribution Systems (2nd Edition) is an introductory guidebook for self study or for use as a textbook in technical programs in electrical technology at vocational/technical schools, industrial training programs or college technical programs. The book uses a “systems” format to teach electrical distribution and associated power system concepts.','pdf','2','Electricity.','2','50','','978-1-4398-0472-8','','','2009-01-02','/tmp/phpipZpGj',NULL,NULL,'/tmp/php2urY8Y',NULL,'487',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 12:44:12','2020-08-18 12:44:12'),(51,1,2,26,NULL,'The Method of Normal Forms',NULL,'This book gives an introductory treatment of the method of normal forms. This technique has its application in many branches of engineering, physics, and applied mathematics. Approximation techniques such as these are important for people working with dynamical problems and are a valuable tool they should have in their tool box.','pdf','1','Normal Forms.','2','47','','978-3-527-41097-2','','','2011-01-01','/tmp/phpzhH0ue',NULL,NULL,'/tmp/phpsrt9pZ',NULL,'342',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 12:54:50','2020-08-18 12:54:50'),(52,1,2,16,NULL,'Light and Optics',NULL,'An understanding of the science of light led to ways of correcting faulty vision, as well as the means of improving vision to study objects too small or too distant to be seen by the unaided eye. The performance of instruments such as microscopes, telescopes, and the human eye depends on the principles of optics. This book dives into exploring various concepts of Light and Optics in the filed of Physics.','pdf','1','Electricity.','2','43','','978-0-8160-6114-3','','','2007-01-01','/tmp/phpBbydqC',NULL,NULL,'/tmp/phpVlhTBd',NULL,'193',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 13:00:27','2020-08-18 13:00:27'),(53,1,2,27,NULL,'Electrical Power Systems Technology',NULL,'Electrical Power Systems Technology (Third Edition) provides a broad overview of the production, distribution, control, conversion, and measurement of electrical power. The presentation method used in this book will allow the reader to develop an understanding of electrical power systems. The units of the book are organized in a systematic manner, beginning with electrical power production methods.','pdf','3','Electricity.','2','31','','978-1-4398-0027-0','','','2009-02-04','/tmp/phpbtPU59',NULL,NULL,'/tmp/phpHrffA6',NULL,'497',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 13:05:07','2020-08-18 13:05:07'),(54,1,2,30,NULL,'Field Models in Electricity and Magnetism',NULL,'This book presents field models in electricity and magnetism, in the frame of an introductory textbook to be used by senior\r\nundergraduate or graduate students in the area of electrical and computer engineering. Elementary electromagnetism, basic vector analysis and fundamentals of numerical\r\nanalysis are assumed to be known subjects.','pdf','1','Electricity. Magnetism','','36','','978-1-4020-6842-3','','','2008-08-28','/tmp/phpqYQzI6',NULL,NULL,'/tmp/phpmZlDB8',NULL,'174',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 13:10:27','2020-08-18 13:10:27'),(55,1,2,16,NULL,'Time and Thermodynamics',NULL,'Time and Thermodynamics explores the physics of heat and temperature and their effects on people’s lives and technology. The word thermo refers to heat, and the word dynamics gives an indication of motion, both of which are vital to the subject.  Thermodynamics provides an ingenious explanation for this, because its laws are an exception to the rest of physics and breaks the symmetry in time. As a result, thermodynamics yields clues about the nature of time, the possibility of time travel, and the very beginning of time, at the creation of the universe.','pdf','1','Physics.','2','43','','978-0-8160-6113-6','','','2020-01-01','/tmp/php41rwgJ',NULL,NULL,'/tmp/php3Ofi7s',NULL,'161',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 13:14:31','2020-08-18 15:11:56'),(56,1,2,27,NULL,'Electricity and Electronics Fundamentals',NULL,'Electricity and Electronics Fundamentals (formerly Understanding Electricity and Electronics) is an introductory text that provides basic coverage of electricity and electronics\r\nfundamentals. The key concepts presented in this book are discussed using a simplified approach that enhances learning. The use of mathematics is kept to the very minimum and\r\nis discussed through applications and illustrations. This second edition includes revised/updated illustrations and content. In addition,\r\nchapters have been added to introduce the topics of electronic communications and electronic power control.','pdf','2','Electricity. Electronics','2','31','','1-4200-8387-2','','','2020-02-02','/tmp/php3FfJIN',NULL,NULL,'/tmp/phpQVu0Ps',NULL,'315',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 13:19:47','2020-08-18 13:22:32'),(57,1,2,46,NULL,'Electricity Experiments for Children',NULL,'It is a good idea to perform the experiments in the order in which they are given, because each one depends, to a large extent, on the knowledge gained in those that came before. While all of the experiments in this book are safe, you must exercise ordinary care and use your common sense. If you follow the directions, everything will work out well. Where warnings are given, be sure to heed them.','pdf','1','Electricity. Children.','2','31','','0·486·2203iJ·3','','','1960-01-01','/tmp/phpncN6er',NULL,NULL,'/tmp/phpsopCEp',NULL,'91',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 13:34:40','2020-08-18 13:34:40'),(58,1,2,47,NULL,'Electricity Economics: Regulation and Deregulation',NULL,'This text was written as a manual for the Russian Federal Energy Commission to train regional electricity rate regulators in the principles of economics and finance involved in regulating electricity markets and deregulating electricity generation. Requiring no familiarity with economics and using a minimum of mathematics, this book provides professionals in the power sector with the tools to face the new realities of electric utility operation.','pdf','1','Electricity. Economics.','2','47','','978-0471234371','','','2003-02-14','/tmp/phpY80yXf',NULL,NULL,'/tmp/phpzBhVkp',NULL,'297',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 13:39:40','2020-08-18 13:39:40'),(59,1,2,13,NULL,'Atomicity and Quanta',NULL,'Early writings by James Jeans exploring the idea of atomicity in the early 20th Century.','pdf','1','Atomicity.','2','45','','978-0-521-74481-2','','','2019-01-01','/tmp/phpslXjuV',NULL,NULL,'/tmp/php1vU6jr',NULL,'65',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 13:45:06','2020-08-18 15:12:35'),(60,1,2,49,NULL,'Lights Out: The Electricity Crisis, the Global Economy, and What It Means to You',NULL,'I wrote this book to call attention to these other, less savory aspects, of electricity. I am a consultant to the industry, and electricity has been my career. I see our industry backsliding, rather than moving forward. I see our leadership in the technology, once unchallenged, now seriously eroded. I see our industry leaders neglect the least valuable and most nettlesome component of the value chain, our transmission system. It is only 10 percent of the “value chain,” but it is the linchpin between supply and demand. Transmission experts describe it as a “third-world grid.”','pdf','1','Electricity. Economics.','2','47','','978-0-470-10918-2','','','2020-01-01','/tmp/phpx8jsx6',NULL,NULL,'/tmp/phpJWwNXJ',NULL,'321',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 13:49:19','2020-08-18 13:51:00'),(61,1,2,50,NULL,'Data, Voice, and Video Cabling',NULL,'This book was developed from the notes of our training classes and is intended as a textbook for training installers of networks, primarily premises cabling for industrial and residential computer local area networks (LANs), which carry voice, data, and video communications. The book contains virtually no theory, only basic descriptions of communications networks in general needed to understand their cabling needs. Instead of scientific detail, this book focuses on the practical aspects of designing, installing, testing, and troubleshooting cabling.','pdf','3','Electricity. Electronics','2','60','','978-1-4283-3472-4','','','2009-01-01','/tmp/phpeIXPFA',NULL,NULL,'/tmp/phpi3ebor',NULL,'335',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 13:56:35','2020-08-18 13:56:35'),(62,1,2,52,NULL,'Electricity Retail Wheeling Handbook',NULL,'This publication is divided into four basic sections: Section 1, Understanding Electric Utility Basics (Chapters 1-3); Section 2, Electricity\r\nRetail Wheeling-The Processes Involved (Chapters 4-6); Section 3, Electricity Retail Wheeling in Action (Chapter 7); and Section Appendices A-E, important background data to assist in reducing electric utility costs','pdf','2','Electricity.','2','50','','978-0881732047','','','1995-01-02','/tmp/phpfMqqdY',NULL,NULL,'/tmp/phphfQ55w',NULL,'301',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 14:02:09','2020-08-18 14:02:09'),(63,1,2,53,NULL,'Nuclear Power: Villain or Victim? Our Most Misunderstood Source of Electricity',NULL,'','pdf','1','Nuclear. Power. Electricity','2','51','','0-9658096-0-9','','','1995-01-04','/tmp/phpBAhsZ9',NULL,NULL,'/tmp/phpPYLRSM',NULL,'108',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 14:06:21','2020-08-18 14:06:21'),(64,1,2,18,NULL,'Schaum\'s Outline of Theory and Problems of Basic Electricity',NULL,'This book is intended as a basic text to cover the fundamentals of electricity and electric circuits. It may be used by beginning students in high schools, technical institutes, and colleges who have no experience in electricity. There are several special features of this book. One is the use of the International System of Units (SI) throughout. A second is the prolific use of equation numbers for reference so that the reader will always know the source of each equation used. Other features include simplified ways to solve problems on three-phase transformer windings, series and parallel resonance, and RL and RC circuit waveforms.','pdf','1','Electricity.','2','32','','978-0585266602','','','1983-01-01','/tmp/phpBYAZhC',NULL,NULL,'/tmp/phpd7HVfN',NULL,'465',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 14:13:22','2020-08-18 14:13:22'),(65,1,2,55,NULL,'Electricity Cost Modelling Calculations',NULL,'As the economist at a state regulatory commission (in a state with predominately coal fired generation), I struggled to understand\r\nthe logic behind the methodology of how rates were set and how costs were allocated among the various customer classes. I still struggle with this today, which is expounded on in this manuscript.','pdf','1','Electricity. Cost Modelling.','2','34','','978 1 85617 726 9','','','2011-01-03','/tmp/phpBtYAAn',NULL,NULL,'/tmp/phpuOKuVX',NULL,'345',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 14:18:50','2020-08-18 14:18:50'),(66,1,2,55,NULL,'Electricity Marginal Cost Pricing',NULL,'Packed with case studies and practical real-world examples, Electricity Marginal Cost Pricing Principles allows regulators, engineers and energy economists to choose the pricing model that best fits their individual market. Written by an author with 13 years of practical experience, the book begins with a clear and rigorous explanation of the theory of efficient pricing and how it impacts investor-owned, publicly-owned, and cooperatively-owned utilities using tried and true methods such as multiple-output, functional form, and multiproduct cost models.','pdf','1','Electricity. Cost. Pricing.','2','34','','978-0-12-385134-5','','','2012-01-03','/tmp/php91vX54',NULL,NULL,'/tmp/phparYsgc',NULL,'352',0,0,0,0,0,'1',1,0,NULL,'2020-08-18 14:23:57','2020-09-02 12:36:07'),(67,1,2,51,NULL,'Electrical Course for Apprentices and Journeymen',NULL,'This book has been planned as a study course either for the classroom or as a self-taught program. It may be utilized without any other books on electrical theory. Trigonometry is covered briefly in this book, because it is useful in making mathematical calculations of alternating currents. For the reader who is not familiar with trigonometry, there are other means of explanation.','pdf','4','Electricity.','2','47','','0-764-54200-1','','','2004-01-02','/tmp/phpfJ6gRD',NULL,NULL,'/tmp/phptSRBkQ',NULL,'424',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 14:28:54','2020-08-18 14:28:54'),(68,1,2,22,NULL,'Electricity from Wave and Tide',NULL,'This book introduces the history, theoretical background and practical development of today’s wave and tidal stream devices to a wide readership including professionals, policy makers and employees in the energy sector needing an introduction or quick update. This is probably the first book to introduce wave and tidal stream technologies in a single volume and, although it assumes some basic familiarity with physics and maths','pdf','1','Electricity.','2','47','','9781118340912','','','2013-01-01','/tmp/phpQHM4q8',NULL,NULL,'/tmp/php5wHBZt',NULL,'280',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 14:33:30','2020-08-18 14:33:30'),(69,1,2,54,NULL,'Matter and Energy: Principles of Matter and Thermodynamics',NULL,'The text for this book has been adapted from a single-volume work entitled Secrets of the Universe: Discovering the Universal Laws of Science, by Paul Fleisher, originally published by Atheneum in 1987.','pdf','1','Physics.','2','53','','0-8225-0674-4','','','2002-01-02','/tmp/phpXyW2ki',NULL,NULL,'/tmp/phpklWPlK',NULL,'65',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 14:38:05','2020-08-18 14:38:05'),(70,1,2,56,NULL,'The Free Energy Secrets of Cold Electricity',NULL,'It wasn\'t until I correlated Gray\'s clues with an analysis by Gerry Vassilatos, published in 1996, detailing Nikola Tesla\'s experimental work in the late 1880\"s, that the picture started coming into focus. These experiments resulted in the discovery of what Tesla called \"radiant energy\" and led to the development of his Magnifying Transmitter. This material was the clue that unraveled the Gray mystery.','pdf','1','Electricity.','2','54','','','','','2000-01-05','/tmp/php71ZZrs',NULL,NULL,'/tmp/phpcynHDI',NULL,'156',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 14:42:56','2020-08-18 14:42:56'),(71,1,2,33,NULL,'Electricity and Electronics for HVAC',NULL,'This book is intended to provide an introduction to the basic principles of electricity and electronics as they apply to refrigeration, heating, and air conditioning systems. It combines basic principles, using very little math, with the latest applications found in the HVAC industry. The fields of refrigeration, air conditioning, and heating are undergoing some very rapid changes. The advent of the computer chip has made it possible to control heating and cooling systems precisely and with a great deal of freedom in programming their applications.','pdf','1','Electricity. Electronics','2','32','','0-07-154270-1','','','2020-01-01','/tmp/phpS51vKZ',NULL,NULL,'/tmp/phpONXCvv',NULL,'405',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 14:47:12','2020-08-18 15:11:01'),(72,1,2,51,NULL,'Electrician\'s Pocket Manual',NULL,'Now fully updated for the 2002 National Electrical Code, the Electrician\'s Pocket Manual is packed with charts, conversions, photographs, diagrams, code standards, and other information you need on the job.','pdf','2','Electricity. Manual','2','32','','0-764-54199-4','','','2003-10-10','/tmp/php7ow2P6',NULL,NULL,'/tmp/phpPeIhkt',NULL,'368',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 14:50:33','2020-08-18 14:50:33'),(73,1,2,52,NULL,'Maximizing Energy Savings and Minimizing Costs',NULL,'This book covers the basics of rate structures, how they apply to energy purchases, the components of the purchase process, and the methods and techniques required for maximizing energy savings and minimizing costs. This book provides the foundation upon which any successful, long-term energy strategy must be based. The foundation of energy cost\r\nminimizing process requires the knowledge of how current energy costs are developed and applied.','pdf','1','Electricity. Economics','2','31','','1-4200-8872-6','','','2009-01-01','/tmp/phpCORryK',NULL,NULL,'/tmp/php322WM1',NULL,'357',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 14:54:41','2020-08-18 14:54:41'),(74,1,2,58,NULL,'Electricity for the Entertainment Electrician & Technician',NULL,'The information contained in this book is not difficult, but it can be challenging. Some of the concepts can challenge your ability to straddle the line between abstract thought and real-world application. But if you love the production arts as much as Po, the kung fu panda, loves food and the martial arts, then you too are capable of impressive feats of artistry. All it takes now is for you to see your reflection in these pages. So I challenge you to dive into this book with the same enthusiasm as a panda bear fighting for a dumpling.','pdf','1','Electricity.','2','34','','978-0-240-80995-3','','','2009-01-01','/tmp/phpciSziR',NULL,NULL,'/tmp/phpT6LG5c',NULL,'271',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 15:06:04','2020-08-18 15:06:04'),(75,1,2,8,NULL,'Teach Yourself Electricity and Electronics',NULL,'As you read this book, you’ll encounter hundreds of quiz, test, and exam questions that can help you measure your progress. They are written like the questions found in standardized tests used by educational institutions. This book is for people who want to learn the fundamentals of electricity, electronics, and related\r\nfields without taking a formal course. The book can also serve as a classroom text. This edition contains new material on transducers, sensors, antennas, monitoring, security, and navigation. Material from previous editions has been updated where appropriate.','pdf','4','Electricity.','2','32','','0-07-148709-3','','','2006-01-01','/tmp/phpvO71Hl',NULL,NULL,'/tmp/phpKlQADF',NULL,'721',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 15:18:33','2020-08-18 15:18:33'),(76,1,2,60,NULL,'Electricity (Early Bird Energy)',NULL,'This book is aimed at introducing electricity concepts to kids below the age of 10.','pdf','1','Electricity. Children.','2','53','','0–8225–6330–4','','','2006-01-01','/tmp/php6GNtzo',NULL,NULL,'/tmp/phpYiYrv4',NULL,'50',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 15:24:22','2020-08-18 15:24:22'),(77,1,2,51,NULL,'Guide to the 2005 National Electrical Code',NULL,'Understanding and following the voluminous National Electrical Code is a constant challenge. You need a reference that doesn\'t waste your time. This guide extracts the information necessary for you, the installer, then arranges it for easy access and highlights the changes so you can quickly spot what\'s new. Whether you\'re a novice or a veteran, you\'ll want this book with you on every job for higher performance.','pdf','2','Electricity.','2','47','','978-0764578021','','','2008-03-12','/tmp/php96nB37',NULL,NULL,'/tmp/php388EtA',NULL,'842',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 15:29:13','2020-08-18 15:29:13'),(78,1,5,54,NULL,'Objects in motion: Principals of classical mechanics',NULL,'The text for this book has been adapted from a single-volume work entitled Secrets of the Universe: Discovering the Universal Laws of Science, by Paul Fleisher, originally published by Atheneum in 1987.','pdf','1','Mechanics. Elementary.','2','53','','0-8225-0683-1','','','1970-01-01','/tmp/phpYUeyqT',NULL,NULL,'/tmp/phpnZCUnc',NULL,'81',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 15:34:27','2020-08-18 15:34:27'),(79,1,2,8,NULL,'Alternative Energy Demystified',NULL,'This book is for people who want to learn about diverse energy sources and technologies without taking a formal course. It can serve as a classroom supplement, tutorial aid, self-teaching guide, or home-schooling text. You don’t need a mathematical or scientific background for this course. Middle school algebra, geometry, and physics will suffi ce. I recommend that you complete one chapter a week. This is an entry-level science non-fiction book for students and lay people. It is not intended to promote or condemn any particular energy source, ideology, agenda, or economic interest.','pdf','1','Alternative Energy.','2','32','','0-07-147554-0','','','2007-01-01','/tmp/phpLP64Zf',NULL,NULL,'/tmp/phplbVHUi',NULL,'337',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 15:40:25','2020-08-18 15:40:25'),(80,1,2,51,NULL,'Questions and Answers for Electrician’s Examinations',NULL,'Now, as for being physically and mentally prepared, I think most readers are familiar with the way athletes prepare for an event. They make sure they eat the right kinds of food so that they have enough energy. They get plenty of sleep, and they come to the event planning on winning. The same thing should be done in preparation for a test.','pdf','14','Electricity.','2','47','','0-7645-4201-X','','','2004-01-01','/tmp/phpOm4bbM',NULL,NULL,'/tmp/phpir0wYl',NULL,'314',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 15:46:40','2020-08-18 15:46:40'),(81,1,2,62,NULL,'Protection of Electricity Distribution Networks',NULL,'This book has been produced as a reference guide for professional engineers and students.The book is based on original material by Mr Gers and translated from the Spanish\r\nby Mr Holmes. Subsequently the authors have expanded the text considerably and added much up to date material.','pdf','2','Electricity.','2','41','','978-0-86341-537-1','','','2004-01-01','/tmp/phph5vJOo',NULL,NULL,'/tmp/phpxYNQIu',NULL,'357',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 15:52:56','2020-08-18 15:52:56'),(82,1,2,65,NULL,'Electricity And Magnetism: Stop Faking It! Finally Understanding Science So You Can Teach It',NULL,'Shocked by static? Mixed up about magnets? Curious about currents? This book will help you get beyond memorizing electricity-related formulas, rules, and procedures so you can understand the topic at a deep level deep enough to teach it with confidence and comfort. By covering the basics of static electricity, current electricity, and magnetism, the book develops a scientific model showing that electricity and magnetism are really the same phenomenon in different forms.','pdf','1','Electricity. Children.','2','57','','0-87355-236-9','','','2004-10-30','/tmp/phpwyWgkk',NULL,NULL,'/tmp/phpy7P78z',NULL,'173',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 15:57:55','2020-08-18 15:57:55'),(83,1,2,8,NULL,'Electricity Experiments You Can Do at Home',NULL,'','pdf','1','Electricity. Experiments.','2','32','','978-0-07-162163-2','','','2010-01-01','/tmp/phpvOZdLO',NULL,NULL,'/tmp/phpk8O6xh',NULL,'352',0,0,0,0,0,'1',0,0,NULL,'2020-08-18 16:01:24','2020-08-18 16:01:24'),(84,1,2,8,NULL,'Electronics Portable Handbook',NULL,'This is a handy, easy-to-carry general reference for electronics technicians, engineers, hobbyists, and students. Some information is provided in the fields of mathematics, physics, and chemistry as applicable to electronics. Lists of electronics abbreviations and schematic symbols are also included. Every effort has 