/tmp/phpAtbcLL',NULL,'187',0,0,0,0,0,'1',0,0,NULL,'2020-09-01 13:07:40','2020-09-01 13:07:40'),(123,5,15,72,NULL,'Infrastructure to 2030: Telecom, Land Transport, Water and Electricity',NULL,'This publication is based on a series of expert papers whose purpose was to establish a broader picture of trends and developments that are likely to impact on infrastructures and infrastructure investment over the next few decades, and to assess how the longer term future may unfold in each of the infrastructure sectors under review – electricity transmission and distribution, surface transport, water, and telecommunications and broadband. In addition to the drivers traditionally reviewed in such forward-looking studies (economic growth, population, income levels, etc.), the authors have explored the potential impact on infrastructure development of other factors such as climate change, security issues, the likely evolution of public finances, human settlement patterns, and technology-induced substitution effects.','pdf','','TELECOM, LAND TRANSPORT, WATER AND ELECTRICITY','2','62','','92-64-02398-4','','','2020-01-02','/tmp/phpuMNZHT',NULL,NULL,'/tmp/phpl3gsq7',NULL,'360',0,0,0,0,0,'1',0,0,NULL,'2020-09-02 15:06:59','2020-09-02 15:08:11'),(124,5,15,72,NULL,'Ageing and Employment Policies: Canada',NULL,'This report on Canada is one in a series of 21 OECD country reports that will be published as part of the older worker thematic review, which has been developed by Raymond Torres. It has been prepared by Steven Tobin under the supervision of Mark Keese (team leader). This report is based on the proceedings of a seminar and is published in English only. However, a French translation of the Executive Summary and Recommendations has been included in this volume (see p. 19).','pdf','','Canada.','2','62','','92-64-01244-3','','','2005-01-01','/tmp/php5eInb2',NULL,NULL,'/tmp/phpYUFnWW',NULL,'139',0,0,0,0,0,'1',0,0,NULL,'2020-09-02 15:13:40','2020-09-02 15:13:40'),(125,5,15,72,NULL,'Ageing and Employment Policies: Netherlands',NULL,'This report on the Netherlands is one in a series of around 20 OECD country reports that will be published as part of the older worker thematic review, which has been developed by Raymond Torres. It has been prepared by Anne Sonnet from the OECD, with a contribution from Wiemer Salverda and Ellen Finsveen from the Amsterdam Institute for Advanced Labour Studies of the University of Amsterdam acting as consultants to the OECD, under the supervision of Mark Keese (team leader). This report is based on the proceedings of a seminar and is published in English only. However, a French translation of the Executive Summary and Recommendations has been included in this volume (see p. 19).','pdf','','Netherlands','2','62','','92-64-01208-7','','','2005-01-01','/tmp/phpLNjwa8',NULL,NULL,'/tmp/phpL44Ioj',NULL,'145',0,0,0,0,0,'1',0,0,NULL,'2020-09-02 15:17:29','2020-09-02 15:17:29'),(126,5,15,72,NULL,'Beyond Rhetoric: Adult Learning Policies and Practices',NULL,'This comparative report provides an overview of the adult learning policies and practices within\r\nthe participating countries and concludes by identifying a range of desirable features that make for\r\nsuccessful adult learning systems.','pdf','','Learning Policies.','2','62','','92-64-19943-8','','','2003-01-01','/tmp/phpNLojCu',NULL,NULL,'/tmp/phpAeTBKz',NULL,'255',0,0,0,0,0,'1',0,0,NULL,'2020-09-02 15:24:16','2020-09-02 15:24:16'),(127,5,15,72,NULL,'Central Government Debt: Statistical Yearbook (1996-2005)',NULL,'The focus of the present publication is to provide comprehensive quantitative information on marketable central government debt instruments in all OECD member countries. The coverage of the data is limited to central government debt issuance and excludes therefore state and local government debt and social security funds. This publication benefited from the work of the Financial Statistics Unit of the OECD Statistics Directorate but could not have been accomplished without the contribution of OECD member countries. It is published on the responsibility of the Secretary General of the OECD.','pdf','','Debt. Statistical Book','2','62','','92-64-02382-8','','','2006-01-02','/tmp/phpo63fMW',NULL,NULL,'/tmp/php4cfLHW',NULL,'361',0,0,0,0,0,'1',0,0,NULL,'2020-09-02 15:30:32','2020-09-02 15:30:32'),(128,5,15,72,NULL,'Creditor Reporting System: Aid Activities in Support of Gender Equality (1999-2003)',NULL,'This report examines data on DAC members’\r\naid targeting the objective of gender equality in\r\nrecent years. It is based on donors’ reporting on\r\nbilateral Official Development Assistance (ODA) commitments to the Creditor Reporting System (CRS) Aid Activity Database and, in particular, the\r\nuse of the gender equality policy marker to identify the relevant activities.','pdf','','','2','62','','','2005','6','2005-06-01','/tmp/phpGOeug3',NULL,NULL,'/tmp/php07keP9',NULL,'322',0,0,0,0,0,'1',0,0,NULL,'2020-09-02 15:36:54','2020-09-02 15:36:54'),(129,5,15,72,NULL,'From Red Tape to Smart Tape: Administrative Simplification in OECD Countries',NULL,'This report was carried out under the auspices of the OECD\'s Working Party on Regulatory\r\nManagement and Reform as part of the Public Governance and Territorial Development Directorate’s\r\nwork programme. The report was prepared by Peter Ladegaard under the supervision of Cesar\r\nCordova-Novion and the direction of Rolf Alter. Peter Czaga, Jeffrey Lubbers and Rex Deighton-Smith\r\ncontributed to the drafting of the synthesis report.','pdf','','','2','62','','92-64-10067-9','','','2003-01-01','/tmp/phpaHJm7i',NULL,NULL,'/tmp/phpJbGxps',NULL,'264',0,0,0,0,0,'1',0,0,NULL,'2020-09-02 15:42:43','2020-09-02 15:42:43'),(130,5,15,72,NULL,'Government R&D Funding and Company Behaviour:  Measuring Behavioural Additionality',NULL,'In order to improve the evaluation of business R&D support programmes, the OECD\r\nWorking Party on Innovation and Technology Policy (TIP) launched a project to measure\r\nthe so-called behavioural additionality effects. This report synthesises the results of the project.','pdf','','','2','62','','92-64-02584-7','','','2006-01-01','/tmp/php8sA3NA',NULL,NULL,'/tmp/php9R0zRB',NULL,'247',0,0,0,0,0,'1',0,0,NULL,'2020-09-02 15:46:51','2020-09-02 15:46:51'),(131,5,15,72,NULL,'International Investment Perspectives',NULL,'International Investment Perspectives is an annual publication. Each issue contains\r\nan update of trends and prospects in international investment and provides analyses of\r\ninvestment policy questions of topical interest. The publication aims to provide timely\r\ninformation to members of the investment policy community, academia and members of\r\nthe public with an interest in international investment.','pdf','2006','','2','62','','92-64-02689-4','','','2006-01-01','/tmp/php93YsNF',NULL,NULL,'/tmp/phpU8qsbT',NULL,'263',0,0,0,0,0,'1',0,0,NULL,'2020-09-02 15:50:07','2020-09-02 15:50:07'),(132,5,15,72,NULL,'Measuring Knowledge Management in the Business Sector: First Steps',NULL,'This book presents a synthetic view of the results of the surveys carried out in\r\nCanada, Denmark, France and Germany, as well as statistical analysis about various\r\nissues dealing with KM and a policy discussion.','pdf','','','2','62','','92-64-10026-1','','','2003-01-01','/tmp/phpmOmnIk',NULL,NULL,'/tmp/phpiFkofM',NULL,'222',0,0,0,0,0,'1',0,0,NULL,'2020-09-02 15:55:30','2020-09-02 15:55:30'),(133,5,15,72,NULL,'Entrepreneurship: A Catalyst for Urban Regeneration',NULL,'The publication examines the most common obstacles to the development\r\nof entrepreneurship in deprived areas and presents some strategies and tools\r\nto foster and support entrepreneurship in those urban areas, both in the\r\nUnited States and in European countries','pdf','','','2','62','','92-64-01731-3','','','2004-01-01','/tmp/phpFqS30A',NULL,NULL,'/tmp/php9bisDS',NULL,'342',0,0,0,0,0,'1',0,0,NULL,'2020-09-02 15:59:05','2020-09-02 15:59:05'),(134,5,15,72,NULL,'Model Tax Convention on Income and on Capital: CONDENSED VERSION',NULL,'This condensed version includes the text of the Model Tax Convention as it read on\r\n28 January 2003 after the adoption of the fifth update by the Council of the OECD.\r\nHistorical notes included in Volume I of the loose-leaf version as well as the detailed list of\r\ntax conventions between OECD Member countries and the background reports that are\r\nincluded in Volume II have not been reproduced in this version.','pdf','2003','','2','62','','92-64-19896-2','','','2003-01-28','/tmp/phpGWfrCe',NULL,NULL,'/tmp/phpLMHvZG',NULL,'344',0,0,0,0,0,'1',0,0,NULL,'2020-09-02 16:02:20','2020-09-02 16:04:04'),(135,5,15,72,NULL,'Model Tax Convention on Income and on Capital: CONDENSED VERSION',NULL,'This condensed version includes the text of the Model Tax Convention as it read on\r\n15 July 2005 after the adoption of the sixth update by the Council of the OECD. Historical\r\nnotes included in Volume I of the loose-leaf version as well as the detailed list of tax\r\nconventions between OECD Member countries and the background reports that are\r\nincluded in Volume II have not been reproduced in this version.','pdf','2005','','2','62','','','','','2005-07-15','/tmp/phpdykgOP',NULL,NULL,'/tmp/phpN8v2CY',NULL,'375',0,0,0,0,0,'1',0,0,NULL,'2020-09-02 16:08:29','2020-09-02 16:08:29'),(136,5,15,72,NULL,'OECD Agricultural Outlook: Year (2003-2008)',NULL,'The OECD Agricultural Outlook provides a medium term assessment of\r\nfuture trends and prospects in the major agricultural commodity markets,\r\nincluding sugar on this occasion, of OECD countries. The report is published\r\nannually, as part of a continuing effort to promote informed discussion of\r\nemerging policy issues.','pdf','','','2','62','','92-64-10302-3','','','2003-01-01','/tmp/phpiIOY32',NULL,NULL,'/tmp/phphRAAud',NULL,'211',0,0,0,0,0,'1',0,0,NULL,'2020-09-02 16:11:39','2020-09-02 16:11:39'),(137,5,15,72,NULL,'OECD Economic Surveys: Finland',NULL,'This Survey is published on the responsibility of the Economic and Development Review\r\nCommittee (EDRC) of the OECD, which is charged with the examination of the economic situation of\r\nmember countries.\r\nThe economic situation and policies of Finland were reviewed by the Committee on\r\n30 March 2006. The draft report was then revised in the light of the discussions and given final\r\napproval as the agreed report of the whole Committee on 6 April 2006.','pdf','','','2','62','','92-64-02606-1','2006','5','2006-01-01','/tmp/phpB3u7ew',NULL,NULL,'/tmp/phpr77fR3',NULL,'146',0,0,0,0,0,'1',0,0,NULL,'2020-09-02 16:17:06','2020-09-02 16:17:06'),(138,5,15,72,NULL,'OECD Economic Surveys: France',NULL,'This Survey is published on the responsibility of the Economic\r\nand Development Review Committee of the OECD, which is\r\ncharged with the examination of the economic situation of member\r\ncountries.\r\nThe economic situation and policies of France were\r\nreviewed by the Committee on 20 May 2003. The draft report\r\nwas then revised in the light of the discussions and given final\r\napproval as the agreed report of the whole Committee on\r\n26 June 2003.','pdf','','','2','62','','92-64-01485-3','2003','11','2003-07-01','/tmp/php0RdTGb',NULL,NULL,'/tmp/php500zwj',NULL,'179',0,0,0,0,0,'1',0,0,NULL,'2020-09-02 16:21:06','2020-09-02 16:21:06'),(139,5,15,72,NULL,'OECD Economic Surveys: Germany',NULL,'This survey is published on the responsibility of the Economic and Development Review\r\nCommittee of the OECD, which is charged with the examination of the economic situation\r\nof member countries.','pdf','','','2','62','','92-64-02515-4','2006','8','2006-07-11','/tmp/phprfOppB',NULL,NULL,'/tmp/php1rPjXA',NULL,'158',0,0,0,0,0,'1',0,0,NULL,'2020-09-02 16:26:17','2020-09-02 16:26:17'),(140,5,15,72,NULL,'OECD Economic Surveys: Japan',NULL,'This survey is published on the responsibility of the Economic and Development Review\r\nCommittee of the OECD, which is charged with the examination of the economic situation\r\nof member countries.','pdf','','','2','62','','฀9฀2฀-฀6฀4฀-฀0฀2฀6฀9฀5฀-฀9','2006','13','2020-07-22','/tmp/phpYxbDvP',NULL,NULL,'/tmp/phpSy0Iwr',NULL,'200',0,0,0,0,0,'1',0,0,NULL,'2020-09-02 16:29:14','2020-09-02 16:29:14'),(141,5,15,72,NULL,'OECD e-Government Studies: The e-Government Imperative',NULL,'This report was written by Tim Field, Elizabeth Muller and Edwin Lau of the\r\nOECD E-Government Task Force of the Public Governance and Territorial Development\r\nDirectorate. Hélène Gadriot-Renard and Christian Vergez are the coordinators of the\r\nProject. The report was prepared under the direction of the E-Government Working\r\nGroup and the OECD Public Management Committee, and is published on the\r\nresponsibility of the Secretary-General of the OECD.','pdf','','','2','62','','92-64-10117-9','','','2003-01-01','/tmp/php8tOXIj',NULL,NULL,'/tmp/phpCfsrVj',NULL,'',0,0,0,0,0,'1',0,0,NULL,'2020-09-02 16:32:05','2020-09-02 16:32:05'),(142,5,15,72,NULL,'OECD Employment Outlook: Towards More and Better Jobs',NULL,'The OECD Employment Outlook is the joint work of members of the Directorate for\r\nEmployment, Labour and Social Affairs, and is published on the responsibility of the Secretary-\r\nGeneral of the OECD. This report is based on draft contributions from Glenda Quintini and Paul\r\nSwaim (Chapters 1 and 2), Anne Saint-Martin and Peter Whiteford (Chapter 3), David Grubb and\r\nKoji Miyamoto (Chapter 4), Andrea Bassanini and Wooseok Ok (Chapter 5).','pdf','2003','','2','62','','92-64-10061-X','','','2003-07-01','/tmp/php4uGoCX',NULL,NULL,'/tmp/phpXWIwhk',NULL,'346',0,0,0,0,0,'1',0,0,NULL,'2020-09-02 16:35:57','2020-09-02 16:35:57'),(143,5,15,72,NULL,'OECD Investment Policy Reviews: China Open policies towards mergers and acquisitions',NULL,'This OECD report charts China’s recent rapid progress in developing a regulatory\r\nframework for cross-border mergers and acquisitions (M&As). It examines the\r\nchallenges that still face the Chinese government in its efforts to encourage inflows of\r\nforeign direct investment (FDI) by this route and draws on the experience of OECD\r\nmember countries to offer a range of policy options to address these challenges.','pdf','','','2','62','','92-64-02193-0','','','2006-01-01','/tmp/phpsvywUx',NULL,NULL,'/tmp/phpaniliE',NULL,'96',0,0,0,0,0,'1',0,0,NULL,'2020-09-02 16:39:29','2020-09-02 16:39:29'),(144,5,15,72,NULL,'OECD Review of Agricultural Policies: China',NULL,'The study was carried out by the OECD Directorate for Food, Agriculture and Fisheries. The\r\nprincipal author was Andrzej Kwiecinski. The Review of Agricultural Policies: China was undertaken as part of an initiative to provide\r\nanalyses of agricultural policies for four major agricultural economies outside the OECD area, the\r\nothers being Brazil, India and South Africa.','pdf','','','2','62','','92-64-01260-5','','','2005-01-01','/tmp/phpznFLgW',NULL,NULL,'/tmp/php0dXhfe',NULL,'238',0,0,0,0,0,'1',0,0,NULL,'2020-09-02 16:42:45','2020-09-02 16:42:45'),(145,5,15,72,NULL,'OECD Reviews of Health Systems: Finland',NULL,'This report was prepared by Jeremy Hurst and Peter Scherer of the OECD Health Division with\r\nthe help of Maria Luisa Gil Lapetra, who provided statistical assistance and Victoria Braithwaite\r\nwho supplied secretarial assistance. The review draws on an analytical framework developed during the OECD Health Project\r\n(2001-2004).','pdf','','','2','62','','92-64-01382-2','','','2005-01-01','/tmp/phpAk3DZC',NULL,NULL,'/tmp/phpmyJW3V',NULL,'109',0,0,0,0,0,'1',0,0,NULL,'2020-09-02 16:45:55','2020-09-02 16:45:55'),(146,5,15,72,NULL,'The New Rural Paradigm: Policies and Governance',NULL,'The process that led to this report has included horizontal research, a number of case\r\nstudies across OECD countries and several international conferences. This process was\r\nDirected by Mario Pezzini (Head) and co-ordinated by Nicola Crosta (Administrator) of\r\nthe OECD Division of Regional 