ncipal author of this report is Peter Fraser of the Energy\r\nDiversification Division, working under the direction of Ralf Dickel, Head\r\nof Division, and Noé van Hulst, Director of the Office for Long Term Cooperation\r\nand Policy Analysis.','pdf','','','2','62','','92-64-1055-65','','','2003-03-13','/tmp/phpX6yVn5',NULL,NULL,'/tmp/phpWS7TdD',NULL,'104',0,0,0,0,0,'1',0,0,NULL,'2020-09-02 17:44:56','2020-09-02 17:44:56'),(158,5,15,72,NULL,'RENEWABLES FOR POWER GENERATION Status & Prospects',NULL,'This study presents policy makers, managers and the interested public with\r\nrelevant information on those renewable energy technologies that have entered\r\nthe electricity market, but are not yet in the mainstream of the energy sector.\r\nPolicy makers will play a vitally important role in capturing the future potential\r\nof these technologies, as government policies will determine their further\r\ntechnological development, cost reduction and competitiveness.','pdf','','','2','62','','92-64-0191-89','','','2020-03-01','/tmp/phpTks37I',NULL,NULL,'/tmp/php3hk7qe',NULL,'194',0,0,0,0,0,'1',0,0,NULL,'2020-09-02 17:46:30','2020-09-02 17:48:04'),(159,5,15,72,NULL,'THE POWER TO CHOOSE: Demand Response in Liberalised Electricity Markets',NULL,'This book has benefited enormously from the contributions of the End Use\r\nWorking Party and its contribution to the IEA Demand Response Workshop\r\nheld in Paris, in February 2003.The author of this book is Michael Jones with\r\ndirection provided by Phil Harrington and contributions from Peter Fraser','pdf','','','2','62','','92-64-10503-4','','','2003-05-01','/tmp/phpFuXC8s',NULL,NULL,'/tmp/phpaLrr3i',NULL,'156',0,0,0,0,0,'1',0,0,NULL,'2020-09-02 17:52:27','2020-09-02 17:52:27'),(160,1,2,20,NULL,'Electricity and Magnetism',NULL,'Have you ever been in class and\r\nnot understood all of what was\r\npresented? Or, you understood\r\neverything in class, but at home,\r\ngot stuck on how to answer a\r\nquestion? Maybe you just\r\nwondered when you were ever\r\ngoing to use this stuff?\r\nThis book is designed to help you understand everything your science book can be used for . . . besides a paperweight!','pdf','','Science','2','32','','0-07-861773-1','','','2004-01-01','/tmp/phpHrjd7A',NULL,NULL,'/tmp/phpYDksxl',NULL,'150',0,0,0,0,0,'1',0,0,NULL,'2020-09-04 08:08:05','2020-09-04 08:08:05'),(161,1,2,29,NULL,'Practical Applied Electricity',NULL,'This book is intended primarily for those persons who are\r\ndesirous of obtaining a practical knowledge of the subject of\r\nElectricity, but are unable to take a complete course in Electrical Engineering.','pdf','3','Electricity.','2','35','','','','','1916-07-12','/tmp/phpXCu2VK',NULL,NULL,'/tmp/phpSL8MOc',NULL,'456',0,0,0,0,0,'1',0,0,NULL,'2020-09-04 08:14:14','2020-09-04 08:14:14'),(162,1,2,61,NULL,'Power System Economics: Designing Markets for Electricity',NULL,'The first systematic presentation of electricity market design-from the basics to the cutting edge. Unique in its breadth and depth. Using examples and focusing on fundamentals, it clarifies long misunderstood issues-such as why today\'s markets are inherently unstable. The book reveals for the first time how uncoordinated regulatory and engineering policies cause boom-bust investment swings and provides guidance and tools for fixing broken markets. It also takes a provocative look at the operation of pools and power exchanges.','pdf','','Markets. Electricity','2','47','','978-0-471-15040-4','','','2002-05-01','/tmp/phpfECSQx',NULL,NULL,'/tmp/phpNNMZSS',NULL,'496',0,0,0,0,0,'1',0,0,NULL,'2020-09-04 08:19:58','2020-09-04 08:19:58'),(163,1,2,27,NULL,'Understanding DC Circuits',NULL,'This is an introductory text that provides coverage of the various topics in\r\nthe field of direct current (de) electronics. The key concepts presented in this book are discussed in\r\na simplified approach that greatly enhances learning. The use of mathematics is discussed clearly\r\nthrough applications and illustrations.','pdf','1','Electricity.','2','48','','0-7506-7110-6','','','2000-02-08','/tmp/phpNw6lOc',NULL,NULL,'/tmp/phpFDXEbb',NULL,'543',0,0,0,0,0,'1',0,0,NULL,'2020-09-04 08:27:08','2020-09-04 08:27:08'),(164,1,2,25,NULL,'Non-Linear Oscillations',NULL,'This book is to be used for classroom as well as a reference book. The book emphasizes the physical aspect of the systems and consequently serves as a companion to Perturbation Methods. Many examples are worked out completely, in many cases the results are graphed and the explanations are couched in physical terms.','pdf','1','Oscillations.','2','47','','0-471-12142-8','','','1995-02-15','/tmp/php5L6zbE',NULL,NULL,'/tmp/phprMpcup',NULL,'722',0,0,0,0,0,'1',0,0,NULL,'2020-09-04 08:47:01','2020-09-04 08:47:01'),(165,5,15,64,NULL,'Energy balances and Electricity Profiles',NULL,'This is the thirteenth issue of Energy Balances\r\nand Electricity Profiles published by the United Nations\r\nStatistics Division. The publication presents energy data\r\nfor selected countries in a format which shows the\r\noverall picture of energy production, conversion and\r\nconsumption for fuels utilised in the country.','pdf','','','2','56','','978-92-1-061224-1','','','2006-07-11','/tmp/phpIxVBKy',NULL,NULL,'/tmp/phpsNv40H',NULL,'493',0,0,0,0,0,'1',0,0,NULL,'2020-09-04 08:52:28','2020-09-04 08:52:28'),(166,1,2,8,NULL,'Teach Yourself Electricity and Electronics',NULL,'This book will help you learn the fundamentals of electricity and electronics without taking a formal course. It can serve as a do-it-yourself study guide or as a classroom text. This sixth edition contains new material about switching power supplies, class-D amplifiers, lithium-polymer batteries, microcontrollers, and Arduino.','epub','6','Electricity.','2','32','','978-1-25-958554-8','','','2016-07-13','/tmp/phpB0Dd6O',NULL,NULL,'/tmp/phposdwbW',NULL,'1215',0,0,0,0,0,'1',0,0,NULL,'2020-09-04 09:16:07','2020-09-04 09:16:07'),(167,1,2,33,NULL,'Air Conditioning and Refrigeration',NULL,'Filled with easy-to-read tables and charts, Air Conditioning and Refrigeration covers: fundamentals of air conditioning and refrigeration; step-by-step instructions for installation, repair, and maintenance; trouble-shooting advice; problems and worked-out equations will have SI units for international usage; professional organizations; important web sites; valuable tips on buying air conditioning or refrigeration units; and the most up-to-date tools and devices used in the trade.','pdf','1','Air conditioning. Refrigeration.','2','32','','9780071467889','','','2006-04-01','/tmp/phpXj4DUC',NULL,NULL,'/tmp/phpQ5iYhU',NULL,'626',0,0,0,0,0,'1',0,0,NULL,'2020-09-04 09:33:02','2020-09-04 09:33:02'),(168,4,10,59,NULL,'From Edison to Enron: The Business of Power and What It Means for the Future of Electricity',NULL,'From Edison to Enron traces the controversial history of this $210 billion industry--the nation\'s largest--showcasing the key individuals, technological innovations, corporate machinations, and political battles that have been waged over its domination. Munson argues that current policies and practices, including those favored by the Bush Administration, are preventing entrepreneurs from producing more efficient, healthy, and sustainable power supplies.','pdf','','','2','55','','9780275987404','','','2005-09-30','/tmp/php8KvDCe',NULL,NULL,'/tmp/phpLtdM3w',NULL,'207',0,0,0,0,0,'1',0,0,NULL,'2020-09-04 09:44:05','2020-09-04 09:44:05'),(169,1,2,22,NULL,'Digital Signals, Processors and Noise',NULL,'This Series offers introductions to advanced topics. The level is generally\r\nthat of second and subsequent years of undergraduate courses in electronic\r\nand electrical engineering, computer science and physics. Some of the\r\nauthors will paint with a broad brush; others will concentrate on a\r\nnarrower topic, and cover it in greater detail.','pdf','1','Electronics.','2','46','','978-0-333-54587-4','','','1992-03-18','/tmp/phpKp509h',NULL,NULL,'/tmp/phpitg91F',NULL,'232',0,0,0,0,0,'1',0,0,NULL,'2020-09-04 09:50:27','2020-09-04 09:50:27'),(170,1,2,45,NULL,'The Audiophile\'s Project Sourcebook',NULL,'The Audiophile’s Project Sourcebook is intended for electronics hobbyists and audiophiles who enjoy constructing their own “high-end” audio equipment, and who also desire a more complete understanding of the fundamentals involved with audio design. In addition, the information contained in this book will equip audio enthusiasts with the practical knowledge for experimentation and modifications to existing audio equipment, as well as clarifying issues of application compatibility. This heavily illustrated volume contains circuit schematics and step-by-step photos for each project. Also includes a complete parts list and the best audio power amplifier designs.','epub','1','','2','32','','9780071379298','','','2001-10-30','/tmp/phpUCbUYP',NULL,NULL,'/tmp/phpfEqGVZ',NULL,'345',0,0,0,0,0,'1',0,0,NULL,'2020-09-04 10:00:19','2020-09-04 10:00:19'),(171,1,2,35,NULL,'Electricity',NULL,'This text is not primarily concerned with applications, but with the\r\nbasic principles of electricity underlying all the applications. It will assist\r\nyou in gaining an understanding of the laws governing voltage, current,\r\nresistance, and power, as well as the somewhat more complex concepts of\r\nalternating current-the principles that are the basis for electronics.','pdf','1','','2','63','','1-56676-907-8','','','2020-02-07','/tmp/phplf8YSM',NULL,NULL,'/tmp/phpsvliI2',NULL,'271',0,0,0,0,0,'1',0,0,NULL,'2020-09-04 10:08:16','2020-09-04 10:11:34'),(172,1,2,45,NULL,'High power Audio Amplifier Construction Manual',NULL,'Ideal for audiophiles, electronics hobbyists, and audio engineers, here is the ultimate audio amplifier dream-to-reality book, giving you leading-edge electronic stools for designing every detail of a superior high-power amplifier. Using Randy Slone\'s ready-to-construct recipes, you can-in less time than you think-put together an amplifier that\'s a major step up from commercial offerings.','pdf','1','Electricity.','2','32','','0-07-13-4119-6','','','1999-01-01','/tmp/php9J4xVH',NULL,NULL,'/tmp/phpgA5sVp',NULL,'497',0,0,0,0,0,'1',0,0,NULL,'2020-09-04 10:27:58','2020-09-04 10:27:58'),(173,1,2,8,NULL,'Ham and Shortwave Radio for the Electronics Hobbyist',NULL,'This book shows you, step by step, how to set up and operate your own ham radio station. It’s also perfect for those interested in shortwave listening, without getting a ham radio license. This practical guide covers communications modes, assigned frequency ranges in the United States, details on fixed, mobile, and portable ham stations, antennas, and much more.','epub','1','','2','32','','978-0-07-183292-2','','','2014-10-06','/tmp/phpIrCL1J',NULL,NULL,'/tmp/phpctaglr',NULL,'380',0,0,0,0,0,'1',0,0,NULL,'2020-09-04 10:34:16','2020-09-04 10:34:16'),(174,1,2,22,NULL,'Electricity from Sunlight: An Introduction to Photovoltaics',NULL,'This book is aimed at a wide readership including professionals working in related areas, and students taking introductory courses in PV and renewable energy. Its style and level will also appeal to energy planners and decision makers, members of environmental organisations, and the increasing number of people interested in generating their own electricity from sunlight.','pdf','1','Energy','2','47','','9780470745601','','','2010-06-15','/tmp/phpweOwVn',NULL,NULL,'/tmp/phpGbtCVl',NULL,'239',0,0,0,0,0,'1',0,0,NULL,'2020-09-04 10:38:05','2020-09-04 10:38:05'),(175,1,2,51,NULL,'Dewalt Security, Sound, & Video Professional Reference',NULL,'This outstanding pocket guide is designed for use on-the-job by security, sound, and video professionals. It is chock full of everything users need for working with security, sound, and video equipment and features installation requirements, formulas, technical data, and maintenance forms.','pdf','1','','2','52','','9780977000326','','','2005-09-08','/tmp/phpLcwE0U',NULL,NULL,'/tmp/phpWxLH5t',NULL,'386',0,0,0,0,0,'1',0,0,NULL,'2020-09-04 10:44:11','2020-09-04 10:44:11'),(176,1,2,57,NULL,'Understanding Electronics',NULL,'Covers symbols, circuits, resistors, capacitors, transformers, semiconductors, tubes, integrated circuits, amplifiers, oscillators, printed circuits, and microprocessors.','pdf','3','Electronics.','2','32','','9780830693443','','','1989-03-07','/tmp/phpM3YCNB',NULL,NULL,'/tmp/phpJj6yvJ',NULL,'205',0,0,0,0,0,'1',0,0,NULL,'2020-09-04 10:48:10','2020-09-04 10:48:10'),(177,1,2,17,NULL,'Basic Electricity and Electronics for Control: Fundamentals and Applications',NULL,'This book is about behavior, not design, and thus lends itself to an easy-to-understand format over absolute technical perfection. And where possible, applications are used to illustrate the topics being explained.The text uses a minimum of mathematics and where algebraic concepts are utilized there is sufficient explanation of the operation, so you may see the solution without actually performing the mathematical operations.','pdf','3','Electricity. Electronics','2','44','','978-1-55617-988-4','','','2006-03-08','/tmp/phpwISu8R',NULL,NULL,'/tmp/phpF6VKVi',NULL,'397',0,0,0,0,0,'1',0,0,NULL,'2020-09-04 10:54:07','2020-09-04 10:54:07'),(178,1,2,15,NULL,'Discover Physics',NULL,'Since birth, you\'ve wanted to discover things. You started out by putting every available object in your mouth. Later you began asking the grownups all those \"why\" questions. None of this makes you unique — humans are naturally curious animals.','pdf','1','Physics.','2','35','','0-9704670-8-7','','','2006-12-19','/tmp/phpoEmTgC',NULL,NULL,'/tmp/phpEpQaCV',NULL,'212',0,0,0,0,0,'1',0,0,NULL,'2020-09-04 11:10:21','2020-09-04 11:10:21'),(179,5,14,39,NULL,'Planetary Atmospheric Electricity',NULL,'This  is the first publication of its kind in the Space Science Series of ISSI. It is the result of a new and successful joint venture between ISSI and Eu- planet. Europlanet is a network of over 110 European and U. S. laboratories deeply involved in the development of planetary sciences and support to the European planetary space exploration programme.','pdf','1','Electricity.','2','36','','978-0-387-87663-4','','','2008-01-01','/tmp/phphGh0pg',NULL,NULL,'/tmp/phpCo4QdB',NULL,'521',0,0,0,0,0,'1',0,0,NULL,'2020-09-04 11:16:09','2020-09-04 11:16:09'),(180,1,2,51,NULL,'Audel Practical Electricity',NULL,'Practical Electricity, more than any other book available, covers\r\nelectricity in broad terms. The first half of the book is not written for one particular specialty; it is written for all specialties. The\r\nfundamental forces of electricity are explained in terms that are\r\nunderstandable to almost everyone without eliminating anything of\r\nany importance.','pdf','5','Electricity.','2','47','','9780764541964','','','2004-01-01','/tmp/phpdDDNpP',NULL,NULL,'/tmp/phpZjL3jV',NULL,'481',0,0,0,0,0,'1',0,0,NULL,'2020-09-04 11:20:45','2020-09-04 11:20:45'),(181,7,13,73,NULL,'Oxford English for Electrical and Mechanical Engineering',NULL,'Coverage in all four skills with up-to-date technical content.','pdf','1','Electrical Engineering. Mechanical Engineering.','2','64','','978-0194573924','','','1995-09-01','/tmp/phpENV77V',NULL,NULL,'/tmp/phpoFrq2g',NULL,'191',0,0,0,0,0,'1',0,0,NULL,'2020-09-04 15:13:52','2020-09-04 15:13:52'),(182,7,13,73,NULL,'A Dictionary of Science',NULL,'This best-selling dictionary contains over 9,000 entries on all aspects of science and provides comprehensive coverage of biology (including human biology), chemistry, physics, the earth sciences, and astronomy. Appendices cover the periodic table, geological time scale, and animal and plant classification. New features include virtual thumb tags for easy reference, expanded areas including astronomy and earth science and more features on key topics such as the Solar System and Genetically Modified Organisms.','pdf','5','Science','2','64','','0–19–280641–6','','','2005-01-01','/tmp/phpK9XgIF',NULL,NULL,'/tmp/phpPlB8n4',NULL,'892',0,0,0,0,0,'1',0,0,NULL,'2020-09-04 15:30:12','2020-09-04 15:30:12');
